  `inventorULE` tinyint(4) DEFAULT 1,
  `PersonaContacto_idPersonaContacto` int(11) DEFAULT NULL,
  PRIMARY KEY (`idAutor`),
  KEY `fk_Autor_Objeto1_idx` (`Objeto_idObjeto`),
