antivo</p>','2024-11-14 12:06:06'),(151,128,20,61,'24/10/2024 CLARKE ENVÍA IET A OTC','<p>30/10/2024: Traslado CLARKE del IET.&nbsp;</p>\r\n<p style=\'margin: 0cm; text-align: justify;\'><span style=\'font-size: 10.0pt;\'>Estimados se&ntilde;ores/se&ntilde;oras,</span></p>\r\n<p style=\'margin: 0cm; text-align: justify;\'><span style=\'font-size: 10.0pt;\'>&nbsp;</span></p>\r\n<p style=\'margin: 0cm; text-align: justify;\'><span style=\'font-size: 10.0pt;\'>Les informamos que la Oficina de Patentes de Espa&ntilde;a ha emitido el informe sobre el estsado de la t&eacute;cnica (I.E.T.). Para su referencia, nuestro reporte t&eacute;cnico, la copia del documento original emitido, un archivo con los documentos citados, las reivindicaciones pendientes y dos propuestas de reivindicaciones modificadas.</span></p>\r\n<p style=\'margin: 0cm; text-align: justify;\'><span style=\'font-size: 10.0pt;\'>&nbsp;</span></p>\r\n<p style=\'margin: 0cm; text-align: justify;\'><span style=\'font-size: 10.0pt;\'>Por favor para el env&iacute;o de sus comentarios t&eacute;cnicos remitirse a:</span> <span style=\'font-size: 10.0pt;\'>Lorena Vega (</span><a href=\'mailto:lvega@clarkemodet.com\'><span style=\'font-size: 10.0pt;\'>lvega@clarkemodet.com</span></a><span style=\'font-size: 10.0pt;\'>).</span></p>\r\n<p style=\'margin: 0cm; text-align: justify;\'><span style=\'font-size: 10.0pt;\'>&nbsp;</span></p>\r\n<p style=\'margin: 0cm;\'><span style=\'font-size: 10.0pt;\'>En caso de inquietud o duda, por favor no dude en contactarnos.</span></p>\r\n<p style=\'margin: 0cm;\'><span style=\'font-size: 10.0pt;\'>&nbsp;</span></p>\r\n<p style=\'margin: 0cm;\'><span style=\'font-size: 10.0pt;\'>Un cordial saludo,</span></p>\r\n<p style=\'margin: 0cm;\'><span style=\'font-size: 10.0pt;\'>&nbsp;</span></p>\r\n<p style=\'margin: 0cm;\'><span style=\'font-size: 10.0pt;\'>*Rogamos acusar recibo</span></p>\r\n<p style=\'margin: 0cm;\'><span lang=\'EN-US\'>&nbsp;</span></p>\r\n<p>Opini&oacute;n:</p>\r\n<p>