family: Aptos; mso-hansi-theme-font: minor-latin;\'>&nbsp;</span></p>\r\n<ul style=\'margin-top: 0cm;\' type=\'disc\'>\r\n<li class=\'MsoListParagraph\' style=\'margin-left: 0cm; mso-list: l0 level1 lfo1;\'><span style=\'font-size: 11.0pt; mso-ascii-font-family: Aptos; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Aptos; mso-hansi-theme-font: minor-latin;\'>&nbsp;el examinador ha citado 1 documento con categor&iacute;a &ldquo;X&rdquo;, &nbsp;lo que indica que el examinador tiene objeciones sobre la novedad y/o la actividad inventiva porque ha encontrado documentos que anticipan la invenci&oacute;n reivindicada en las reivindicaciones 1 a 9</span></li>\r\n<li class=\'Default\'><span style=\'font-size: 10.0pt;\'>Dado que las reivindicaciones 10 y 12 a 20 se consideran patentables, en el caso de limitar la reivindicaci&oacute;n 1 con el an&aacute;lisis del segundo fluorocromo seg&uacute;n la reivindicaci&oacute;n 10. </span></li>\r\n<li class=\'MsoListParagraph\' style=\'margin-left: 0cm; mso-list: l0 level1 lfo1;\'><span style=\'font-size: 10.0pt;\'>Valorad si quer&eacute;is intentar luchar por el procedimiento con un solo fluorocromo (reivindicaci&oacute;n 1),</span></li>\r\n</ul>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-ascii-font-family: Aptos; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Aptos; mso-hansi-theme-font: minor-latin;\'>&nbsp;</span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-ascii-font-family: Aptos; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Aptos; mso-hansi-theme-font: minor-latin;\'>La fase de r&eacute;plica comenzar&aacute; cuando se publique la solicitud y durar&aacute; 3 meses. Fecha estimada publicaci&oacute;n: marzo 2025. Aunque, es conveniente prepararlo con tiempo. </span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-ascii-font-family: Aptos; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Aptos; mso-hansi-theme-font: minor-latin;\'>&nbsp;</span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-ascii-font-family: Aptos; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Aptos; mso-hansi-theme-font: minor-latin;\'>Quedo a la espera de vuestra opini&oacute;n. </span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-ascii-font-family: Aptos; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Aptos; mso-hansi-theme-font: minor-latin;\'>&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-ascii-font-family: Aptos; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Aptos; mso-hansi-theme-font: minor-latin;\'>Saludos,&nbsp;</span></p>','2024-11-14 12:53:58'),(154,128,20,62,'FACTURA ASOCIADA A TRASLADO IET - PAGADO','<p>06/11/2024 llega portafirmas <a href=\'../../cdn/admin/assets/solicitudes/1472/128/20/cHOI59CqtSWj4LvTRPmb.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Portafirmas - Petici&oacute;n recibida - CONF-2024_000000020387-413EUROS-PATENTE NACIONAL N&ordm; 202330765 (1) EN ESPA&Ntilde;AT&Iacute;TULO _PROCEDIMIEN.msg </a>&nbsp;</p>\r\n<p>FRA&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1472/128/20/5bjYynaS6vHiPIBtZxWU.PDF\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 241030 FRA FACE 23125.2024.PDF </a>&nbsp;</p>\r\n<p>Fecha emisi&oacute;n factura: 30/10/2024</p>\r\n<p>N&ordm; factura: 23125/2024</p>\r\n<p>Importe:</p>\r\n<p style=\'padding-left: 40px;\'>tasas:0</p>\r\n<p style=\'padding-left: 40px;\'>Honorarios: 342&euro;</p>\r\n<p style=\'padding-left: 40px;\'>IVA: 71.82&euro;</p>\r\n<p style=\'padding-left: 40px;\'>TOTAL: 413.82&euro;</p>\r\n<p>7/11/2027 MJB ok en portafirmas.&nbsp;</p>\r\n<p>11/12/2024 LLEGA OTRA VEZ EL PORTAFIRMAS.&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1472/128/20/TsQ5abFdr6VBEjk97SCY.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Portafirmas - Petici&oacute;n recibida - CONF-2024_000000020387-413EUROS-PATENTE NACIONAL N&ordm; 202330765 (1) EN ESPA&Ntilde;AT&Iacute;TULO _PROCEDIMIEN.msg </a>&nbsp;</p>\r\n<p>compruebo, que esta factura ya la hab&iacute;a firmado. entro en el portafirmas y veo que, solo me hab&iacute;an puesto a mi, no estaba firmada por el vicerrector, as&iacute; que, llamo a EVA 3646 (unidad de Albano). no ve la factura. entiendo que, el primer portafirmas no se hab&iacute;a llegado a pagar porque faltaba la firma del vice, por lo que estar&aacute;n revisandolo en el SGI y lo han vuelto a enviar. el segundo portafirmas si que tiene la firma del VIT. por tanto. DOY OK AL PORTAFIRMAS.&nbsp;</p>','2024-11-14 13:01:23'),(170,96,14,69,'10/11/2024: DECISION LILIANA CONTINUAR PATENTE','<p>mail consulta 29/10/2024:</p>\r\n<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/24/96/14/TXSckfatlWivBEpz9Pw1.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: previsi&oacute;n pr&oacute;ximos vencimientos patentes.msg </a>&nbsp;</p>\r\n<p>Corresponde con la anualidad 8 (vencimiento&nbsp; 30/09/2025)</p>\r\n<p>15/11/2024 traslado ok a CLARKE</p>\r\n<p>&nbsp;</p>','2024-11-15 09:32:37'),(171,96,14,70,'15/11/2024 CORREO MJB a AGENTE CONFIRMACIÓN MANTENIMIENTO 8ª ANUALIDAD','<p>de: MJB</p>\r\n<p>a \'Julio Sande\' &lt;JSande@clarkemodet.com&gt;</p>\r\n<p>ASUNTO: MANTENIMIENTO 8&ordf; ANUALIDAD P201830941</p>\r\n<p>TEXTO :&nbsp;</p>\r\n<p class=\'MsoNormal\'>Buenos d&iacute;as Julio,&nbsp;</p>\r\n<p class=\'MsoNormal\'>Seg&uacute;n el listado recibido con los pr&oacute;ximos vencimientos, he de comunicarte que la ULE ha decidido el mantenimiento de la P201830941 una anualidad m&aacute;s, siendo esta la 8&ordf; y vencimiento el 30/09/2025.</p>\r\n<p class=\'MsoNormal\'>Saludos,&nbsp;&nbsp;</p>\r\n<p class=\'MsoNormal\'>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/24/96/14/QZgSkfvIiFDYhcMw3yPE.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 241115_mjb a clarke_MANTENIMIENTO 8 ANUALIDAD P201830941.msg </a>&nbsp;</p>\r\n<p class=\'MsoNormal\'