min/assets/solicitudes/24/124/8/zy9jUrKhdeSXiQTpG0uW.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: RE_ Solicitud de Patente Nacional en Espa&ntilde;a No_ 202230980 - UNIVERSIDAD DE LE&Oacute;N.msg </a>&nbsp;</p>','2024-11-18 09:42:44'),(321,124,8,114,'18/11/2024 OTC ENVÍA CERTIFICADO-TITULO DE CONCESIÓN AL INVESTIGADOR','<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/24/124/8/uhcnwGsf92JVXPTERqvI.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: CONCESI&Oacute;N P202230980.msg </a>&nbsp;</p>','2024-11-18 09:44:47'),(323,124,8,108,'Fecha CONCESIÓN CON EXAMEN SUSTANTIVO ADSAS','<p><strong>ARCHIVO TITULO CONCESI&Oacute;N</strong>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>ARCHIVO N&ordm; PUBLICACION&nbsp; ESXXXXXXXXXXXXXB2</p>','2024-11-18 09:45:48'),(324,99,1,NULL,'28/10/2024 ip a otc envia borrador comunicacion invencion','<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/24/99/1/U4Ed3TBHKgyAYPzNtiQI.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 241028_ip a mib.msg </a>&nbsp;</p>\r\n<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/24/99/1/NJvaSyfDxgslWFGzeY7m.docx\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 241028_Comunicaci&oacute;n invenci&oacute;n_V00.docx </a>&nbsp;</p>\r\n<p class=\'MsoNormal\'>Buenos d&iacute;as,</p>\r\n<p class=\'MsoNormal\'>Os adjunto el documento de comunicaci&oacute;n de invenci&oacute;n del kit que hemos desarrollado y una memoria m&aacute;s completa de la patente. En el documento de la comunicaci&oacute;n de invenci&oacute;n he dejado un par de comentarios de dudas que tenemos. En cuanto me las resolv&aacute;is y me deis el visto bueno, recopilar&eacute; todas las firmas.</p>\r\n<p class=\'MsoNormal\'>Un saludo,</p>\r\n<p class=\'MsoNormal\'>Avelino</p>\r\n<p class=\'MsoNormal\'>Avelino &Aacute;lvarez Ord&oacute;&ntilde;ez<br />Departamento de Higiene y Tecnolog&iacute;a de los Alimentos,<br />Universidad de Le&oacute;n.<br />E-mail: <a href=\'mailto:aalvo@unileon.es\' target=\'_blank\' rel=\'noopener\'>aalvo@unileon.es</a><br />Tel&eacute;fono: (+34) 987 291274</p>','2024-11-18 09:57:38'),(325,99,1,NULL,'18/10/2024 mjb a ip Responde','<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/24/99/1/vf8R5HsT7lze2qyQwJ0I.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 241028_mjb a ip_RE_ Comunicaci&oacute;n de invenci&oacute;n.msg </a>&nbsp;</p>\r\n<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/24/99/1/KBweQvA31hozWLybmpnH.docx\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 241028_Solicitud Patente_V01.docx </a>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>Buenos d&iacute;as, Avelino, </span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>He revisado el documento Comunicaci&oacute;n de invenci&oacute;n (patente) y he de comentarte, que has utilizado una versi&oacute;n muy antigua del modelo. Hay un modelo actualizado en la <a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/47_v202301_20230912.docx\'>web</a>. </span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>En todo caso, te explico. </span></p>\r\n<ul style=\'margin-top: 0cm;\' type=\'disc\'>\r\n<li class=\'MsoListParagraph\' style=\'margin-left: 0cm; mso-list: l0 level1 lfo1;\'><span style=\'font-size: 11.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-US;\'>La autor&iacute;a tiene que sumar 100%. Falta 1 c&eacute;ntimo. </span></li>\r\n<li class=\'MsoListParagraph\' style=\'margin-left: 0cm; mso-list: l0 level1 lfo1;\'><span style=\'font-size: 11.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-US;\'>La estimaci&oacute;n del coste, debes indicar el % de cada a&ntilde;o del proyecto. Cuyas tareas se transforman en la invenci&oacute;n. Si es el 100%, pues el 100% distribuido por anualidades. Necesito saber lo que imputar a cada a&ntilde;o. Lo tienes en UXXI. </span></li>\r\n<li class=\'MsoListParagraph\' style=\'margin-left: 0cm; mso-list: l0 level1 lfo1;\'><span style=\'font-size: 11.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-US;\'>Como aplica los costes, marca las 2 casillas y exlica, que las cepas se pagan 4 a 4 y que la patente&hellip;. Como indiques. Con la EBC como se licencia la tecnolog&iacute;a se establece el royalty.</span></li>\r\n</ul>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>Realiza los cambios y lo firm&aacute;is.</span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>A&uacute;n estoy a la espera que me env&iacute;en el ITP que solicitamos para el KIT a la OEPM sobre la V00 de la memoria. </span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>La que me env&iacute;as (V01) no la tendr&eacute; en cuenta, tendr&aacute;s que revisarla seg&uacute;n te indiquen en el ITP y ser&aacute; la que manejemos. </span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>Saludos,</span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>M&ordf; Jos&eacute;. </span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt;\'>&nbsp;</span></p>\r\n<p class=\'MsoNormal\'>&nbsp;</p>\r\n<p class=\'MsoNormal\' style=\'text-align: justify; background: white;\'><a name=\'SignatureSanitizer__MailAutoSig\'></a><strong><span style=\'font-family: \'Arial\',sans-serif; color: #003c78;\'>Mar&iacute;a Jos&eacute; Barrios Lerma</span></strong></p>\r\n<p class=\'MsoNormal\' style=\'text-align: justify; background: white;\'><strong><span style=\'font-family: \'Arial\',sans-serif; color: #669933;\'>T&eacute;cnico OTC</span></strong></p>\r\n<p class=\'MsoNormal\' style=\'text-align: justify; background: white;\'><strong><span style=\'font-