AD OTC A PRESUPUESTO.</p>','2024-11-26 12:31:55'),(444,126,16,NULL,'26/11/224 ABANDONO','<p>26/11/2024&nbsp; &nbsp;<span style=\'color: #e03e2d;\'><a style=\'color: #e03e2d;\' href=\'../../cdn/admin/assets/solicitudes/1232/126/16/CjnMQvbxolLh8aGqHgez.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento:&nbsp;MAIL CLARKE A OTC_ACUSE.msg </a>&nbsp;</span></p>','2024-11-26 12:44:53'),(445,389,1,NULL,'21/10/2024 desde la OPII se solicita la revisión de la parte de IPR de un proyecto europeo','<p>Se facilitan los siguientes documentos:&nbsp;</p>\r\n<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/1585/389/1/GNQXK2kiRA9ldETJ7C1H.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: mail.msg </a>&nbsp;</p>\r\n<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/1585/389/1/SyIlk0K7MCpfbOxrF5Uw.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: EUPAHW CA Version 4 20241018.pdf </a>&nbsp;</p>\r\n<p><a href=\'../../cdn/admin/assets/solicitudes/1585/389/1/F74VwLZcXCg0miquQdA3.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Intellectual Property and other.pdf </a>&nbsp;</p>','2024-11-26 13:05:50'),(446,389,1,NULL,'24/10/2024 enviado informe elaborado por la OTC','<p>MAIL: <a href=\'../../cdn/admin/assets/solicitudes/1585/389/1/UXn0JGweukCpvid2REo3.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 241024_OTC a ULEOPII.msg&nbsp;</a></p>\r\n<p><span style=\'font-family: \'Calibri\',sans-serif;\'>Buenos d&iacute;as,</span></p>\r\n<p><span style=\'font-family: \'Calibri\',sans-serif;\'>Hemos revisado el Acuerdo de Consorcio que nos has proporcionado, titulado <strong>\'EUPAHW CA Versi&oacute;n 4 20241018\'</strong>, junto con el documento <strong>&ldquo;Intellectual Property and Other&rdquo;</strong>. La documentaci&oacute;n contiene los puntos m&aacute;s importantes a tratar en este tipo de acuerdos. En los documentos se reflejan claramente los aspectos sobre Background, Foreground, as&iacute; como los detalles sobre definiciones, derechos de acceso, restricciones, explotaci&oacute;n, confidencialidad y publicaciones.</span></p>\r\n<p><span style=\'font-family: \'Calibri\',sans-serif;\'>Cabe destacar que, una vez se alcancen resultados, el investigador responsable deber&aacute; comunicarlo a la <strong>Oficina de Transferencia de Conocimiento (OTC)</strong>, para lo cual existen impresos disponibles en este <a href=\'https://www.google.com/url?q=https://www.unileon.es/investigadores/vicerrectorado/normativa-impresos/impresos-oficiales&amp;source=gmail-imap&amp;ust=1730302633000000&amp;usg=AOvVaw0-jm0eu8tofHarDfklhvsn\'><span style=\'font-family: \'Aptos\',sans-serif; color: #0563c1;\'>enlace</span></a>. Es importante tener en cuenta que la OTC est&aacute; en constante mejora y actualizaci&oacute;n de impresos, por lo que siempre debe descargarse la versi&oacute;n m&aacute;s reciente disponible.</span></p>\r\n<p><span style=\'font-family: \'Calibri\',sans-serif;\'>Acompa&ntilde;o este correo con el informe emitido al respecto.</span></p>\r\n<p><span style=\'font-family: \'Calibri\',sans-serif;\'>Un saludo,&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\'font-family: \'Calibri\',sans-serif;\'>Oficina de Transferencia de Conocimiento</span></p>\r\n<p><span style=\'font-family: \'Calibri\',sans-serif;\'>ADJUNTO: </span><a href=\'../../cdn/admin/assets/solicitudes/1585/389/1/m0hoCJgtZs9iAkVOSIcq.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Informe Agrement EUPAHW.pdf </a>&nbsp;</p>','2024-11-26 13:06:26'),(447,182,48,NULL,'','','2024-11-26 13:07:09'),(449,389,1,NULL,'24/10/2024 RESPUESTA INVESTIGADOR','<p class=\'MsoNormal\'>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/1585/389/1/4GM8UPVHgb6pToNACz2S.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 241024 mail respuesta investigador.msg </a>&nbsp;</p>\r\n<p class=\'MsoNormal\'>Hola</p>\r\n<p class=\'MsoNormal\'>Gracias. Esto para mi es muy importante porque tendremos que firmar un acuerdo ULE-INRAe&nbsp;sobre los outputs del experimental que estoy haciendo. Los cerdos son suyos y los derechos de por ejemplo, posibles bacterias de inter&eacute;s que aisle, entiendo que ser&aacute;n compartidos. Ya me lo coment&oacute; el investigador de INRAe&nbsp;en su dia. Cuando venga&nbsp;la semana que viene lo volver&eacute; a hablar con &eacute;l y os digo.</p>\r\n<p class=\'MsoNormal\'>Hector</p>\r\n<p class=\'MsoNormal\'>&nbsp;</p>','2024-11-26 13:18:22'),(450,390,1,NULL,'21/11/2024 primer contacto','<p>Tras ver en los medios que se ha organizado un BIBLIOESCAPE y que hay posible propiedad que proteger, 21/11/2024, MJB llama a Leticia para matener una primera conversaci&oacute;n. Mj env&iacute;a a Leticia las plantillas de propiedad intelectual&nbsp;&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/1114/390/1/QJZtuShpqH2a9YGzgs0I.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: IMPRESOS PROPIEDAD INTELECTUAL.msg </a>&nbsp;y queda a la espera de que Leticia remita un borrador con la documentaci&oacute;n.</p>\r\n<p>21/11/2024 ip a mjb<a href=\'../../cdn/admin/assets/solicitudes/1114/390/1/puP0rUDF8tA1NLI9Qwd7.msg\' target=\'_blank\' rel=\'noopener\'>_mail.msg </a>&nbsp;A&uacute;n no te envi&eacute; nada porque tengo que reunirme con Luis, mi compa&ntilde;ero, pero hasta la pr&oacute;xima semana no podemos. La pr&oacute;xima semana nos ponemos a ello.</p>\r\n<p>25/11/2024 LETICIA remite doc <a href=\'../../cdn/admin/assets/solicitudes/1114/390/1/6H0dqnPh9BUb7GOQesF3.msg\' target=\'_blank\' rel=\'noopener\'>mail_.msg </a>&nbsp;</p>\r\n<p>26/11/2026 LETICIA a MJB_mail carpeta drive <a href=\'../../cdn/admin/assets/solicitudes/1114/390/1/E0hk8B6miGnuIwRAKxrq.msg\' target=\'_blank\' rel=\'noopener\'>mail.msg </a>&nbsp;</p>\r\n<p>26/11/2024_mjb a ip_ <a href=\'../../cdn/admin/assets/solicitudes/1114/390/1/d7Jn0iPrOA5lTqtgIMR3.msg\' target=\'_blank\' rel=\'noopener\'>mail.msg </a>&nbsp;&nbsp;</p>\r\n<p>16/12/2024 MJB REVISO DOC. <a href=\'https://docs.google.com/presentation/d/14qK1fjiBuJ3Or2yXNUfyTDHTfu89kVgh?rtpof=true&amp;usp=drive_fs\'>presentaci&oacute;n BIBLIOESCAPE 2024</a> . No est&aacute; la comunicaci&oacute;n de invenci&oacute;n y echo en falta las instrucciones del juego. se lo pido y reenvio links a las plantillas.&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1114/390/1/eQPtYjckDEH26xXqsRO7.msg\' target=\'_blank\' rel=\'noopener\'>mail.msg </a>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>PTE QUE LETICIA ENV&Iacute;E ALGO. CORREOS SIN COLOCAR EN LA CARPETA:&nbsp;</p>\r\n<p><a href=\'https://drive.google.com/open?id=14oKZtwHX0Dvs64tkMnw0Ad-22TUY8gZz&amp;usp=drive_fs\'>https://drive.google.com/open?id=14oKZtwHX0Dvs64tkMnw0Ad-22TUY8gZz&amp;usp=drive_fs</a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','2024-11-26 13:29:04'),(453,84,1,NULL,'06/07/2016 al 21/08/221','<p><a href=\'https://drive.google.com/open?id=1qVgZk_urd62rYIb1T3dmbaeK_ZiTa5XC&amp;usp=drive_fs\'>mails</a></p>','2024-11-26 14:09:46'),(454,84,2,19,'04/07/2016 PRESENTACIÓN COMUNICACIÓN DE INVENCIÓN','<p><a href=\'../../cdn/admin/assets/solicitudes/1232/84/2/OtuB3isDAy5hNVTvf6We.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 160704_comunicaci&oacute;n de invenci&oacute;n.pdf&nbsp;</a></p>\r\n<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/1232/84/2/Qce4lRI6oON0ZLzkmWCF.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 160705_cesi&oacute;n de derechos.pdf </a>&nbsp;</p>','2024-11-26 14:12:28'),(455,84,2,20,'06/07/2016 PRESENTACIÓN DOCUMENTACIÓN A COMISIÓN INVESTIGACIÓN','<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/1232/84/2/vMQnHDlqOSPE56J9CUph.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 160706_oficio otri a CI.pdf </a>&nbsp;</p>','2024-11-26 14:13:24'),(456,84,2,21,'07/07/2016 COMISIÓN DE INVESTIGACIÓN - DECISIÓN FAVORABLE','<p><a href=\'../../cdn/admin/assets/solicitudes/1232/84/2/Wacfe2O6jAhsFrUug5m1.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 160707_au