\n<p>241023_MJB A IP_mail_Informaci&oacute;n sobre la protecci&oacute;n de un juego.&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/35/142/1/yS7DoGXnOV6bJtHg5sU2.msg\' target=\'_blank\' rel=\'noopener\'>mail.msg </a>&nbsp;</p>\r\n<p>26/11/2024_IP LL_consulta sobre quien paga. LA ULE.</p>\r\n<p>27/11/2024_RESPUESTA IP_ENVIA PRIMER BORRADOR&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/35/142/1/0wOVJ4LXdkbcehWYu8g6.msg\' target=\'_blank\' rel=\'noopener\'>mail.msg </a>&nbsp;</p>\r\n<p>28/11/2024 mjb revisa borrador V00 <a href=\'../../cdn/admin/assets/solicitudes/35/142/1/S63wpxo0DEP4fWblYTdR.docx\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 241127_V00_Comunicación Tripoly.docx </a>&nbsp;</p>\r\n<p><span style=\'text-decoration: underline; color: #236fa1;\'>NOTAS MJB REVISI&Oacute;N</span></p>\r\n<p><span style=\'color: #236fa1;\'>- la autor&iacute;a debe sumar 100. el % de reparto de beneficios debe sumar 50 (marco en amarillo)</span></p>\r\n<p><span style=\'color: #236fa1;\'>- las instrucciones para el archivo de la obra, vienen en el documento (marco en amarillo)</span></p>\r\n<p>Env&iacute;o mail a la investigadora con con el archivo V01&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/35/142/1/5NZpfOnj7z2QSqv6wF9H.docx\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 241127_V01_Comunicaci&oacute;n Tripoly.docx&nbsp;</a></p>\r\n<p>28/11/2024_MJB A IP_mail_env&iacute;o comentarios a ip V01&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/35/142/1/0VlNSM9pF5eoQ4tGWCfy.msg\' target=\'_blank\' rel=\'noopener\'>mail.msg </a>&nbsp;</p>\r\n<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/35/142/1/RrwAcX0sU8TloY1BdFnm.docx\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 241127_V01_Comunicaci&oacute;n Tripoly.docx </a>&nbsp;</p>\r\n<p>10/12/2024 ip a otc_<a href=\'../../cdn/admin/assets/solicitudes/35/142/1/5AOg8EYDalMZxqS3hGNH.msg\' target=\'_blank\' rel=\'noopener\'>Email.msg </a>&nbsp;</p>\r\n<p>la ip env&iacute;a unicamente las instrucciones ( <a href=\'../../cdn/admin/assets/solicitudes/35/142/1/Hho1uVvTsNWIagzQX5jc.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Instrucciones Tripoly.pdf </a>) , y la comunicaci&oacute;n de invenci&oacute;n ( <a href=\'../../cdn/admin/assets/solicitudes/35/142/1/lvMyju9ItBVnqRCrpcDP.docx\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 241127_V01_Comunicación Tripoly.docx )</a> indica que postpone el env&iacute;o del juevo para m&aacute;s adelante.&nbsp;<br />16/12/2024_mjb a ip_<a href=\'../../cdn/admin/assets/solicitudes/35/142/1/h1SUTkRbq8yICwQrG3ed.msg\' target=\'_blank\' rel=\'noopener\'>mail.msg </a>&nbsp;&nbsp;</p>\r\n<p>20/12/2024_LLAMA_QUE ME ENV&Iacute;A LO QUE TIENE, PERO, QUE LO QUIERE MEJORAR CON UNA POC</p>\r\n<p><span style=\'background-color: #f1c40f;\'>ok, quedamos a la espera.&nbsp;</span></p>\r\n<p>&nbsp;</p>','2024-11-28 09:37:50'),(551,142,1,NULL,'RESUMEN DE LA OBRA','<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>El TRIPOLY es un juego de mesa dise&ntilde;ado espec&iacute;ficamente para estudiantes de Podolog&iacute;a que cursan la asignatura de Gesti&oacute;n Cl&iacute;nica Podol&oacute;gica. Combina din&aacute;micas l&uacute;dicas con conceptos clave de la gesti&oacute;n de cl&iacute;nicas, simulando la compra, venta y administraci&oacute;n de propiedades podol&oacute;gicas. El juego incluye elementos como tarjetas de propiedad, administraci&oacute;n financiera y resoluci&oacute;n de imprevistos, lo que lo convierte en una herramienta educativa interactiva.</span></p>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>El TRIPOLY tiene como objetivo principal consolidar los conocimientos te&oacute;ricos de la asignatura mediante una experiencia pr&aacute;ctica y divertida. Ayuda a los estudiantes a:</span></p>\r\n<ul style=\'margin-top: 0; margin-bottom: 0; padding-inline-start: 48px;\'>\r\n<li dir=\'ltr\' style=\'list-style-type: disc; font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\' aria-level=\'1\'>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\' role=\'presentation\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>Comprender los fundamentos de la gesti&oacute;n cl&iacute;nica, como la compra y administraci&oacute;n de recursos.</span></p>\r\n</li>\r\n<li dir=\'ltr\' style=\'list-style-type: disc; font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\' aria-level=\'1\'>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\' role=\'presentation\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>Desarrollar habilidades de toma de decisiones econ&oacute;micas y estrat&eacute;gicas.</span></p>\r\n</li>\r\n<li dir=\'ltr\' style=\'list-style-type: disc; font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\' aria-level=\'1\'>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\' role=\'presentation\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>Aprender conceptos clave como hipotecas, inversi&oacute;n en infraestructura, c&aacute;lculo de impuestos y generaci&oacute;n de ingresos.</span></p>\r\n</li>\r\n</ul>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>Este juego aborda la dificultad de trasladar conceptos abstractos de la gesti&oacute;n cl&iacute;nica a escenarios reales. A trav&eacute;s del TRIPOLY, los estudiantes pueden practicar en un entorno simulado y controlado, permitiendo:</span></p>\r\n<ul style=\'margin-top: 0; margin-bottom: 0; padding-inline-start: 48px;\'>\r\n<li dir=\'ltr\' style=\'list-style-type: disc; font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\' aria-level=\'1\'>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\' role=\'presentation\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>Reducir la complejidad percibida en la gesti&oacute;n de una cl&iacute;nica podol&oacute;gica.</span></p>\r\n</li>\r\n<li dir=\'ltr\' style=\'list-style-type: disc; font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\' aria-level=\'1\'>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\' role=\'presentation\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>Fomentar el aprendizaje activo y la retenci&oacute;n de conocimientos.</span></p>\r\n</li>\r\n<li dir=\'ltr\' style=\'list-style-type: disc; font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\' aria-level=\'1\'>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\' role=\'presentation\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>Brindar una herramienta accesible y motivadora para reforzar habilidades pr&aacute;cticas antes de enfrentarse al mundo laboral.</span></p>\r\n</li>\r\n</ul>\r\n<p><span id=\'docs-internal-guid-b44360d7-7fff-951f-a7e5-bae297fc4f4c\'></span></p>\r\n<p dir=\'ltr\' style=\'line-height: 1.2; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>En resumen, el TRIPOLY no solo ense&ntilde;a conceptos clave, sino que tambi&eacute;n mejora la experiencia de aprendizaje al convertir una asignatura te&oacute;rica en una actividad din&aacute;mica y aplicada.</span></p>','2024-11-28 09:52:23'),(552,142,1,NULL,'ORIGEN DE LA INVENCIÓN - OTROS (NO PROYECTO DE INVESTIGACIÓN)','<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>La distribuci&oacute;n de los 3 cr&eacute;ditos de dicha asignatura de Gesti&oacute;n Cl&iacute;nica Podol&oacute;gica es; 1 cr&eacute;dito de sesiones magistrales, 1 cr&eacute;dito de seminarios y 1 cr&eacute;dito de pr&aacute;cticas en laboratorio.</span></p>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>El juego fue dise&ntilde;ado para fortalecer las competencias espec&iacute;ficas de la asignatura de gesti&oacute;n.</span></p>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>&nbsp;tales como:</span></p>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>1108CT2: Motivaci&oacute;n por la calidad.</span></p>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>1108CT3: Fomento del aprendizaje aut&oacute;nomo.</span></p>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>1108CT4: Promoci&oacute;n del trabajo en equipo.</span></p>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>1108CT5: Capacidad para resolver problemas y tomar decisiones.</span></p>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>1108CT6: Habilidad para gestionar la informaci&oacute;n.</span></p>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>1108CT7: Capacidad de an&aacute;lisis, s&iacute;ntesis y razonamiento cr&iacute;tico.</span></p>\r\n<p dir=\'ltr\' style=\'line-height: 1.2; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>1108CT8: Organizaci&oacute;n y planificaci&oacute;n.</span></p>\r\n<p dir=\'ltr\' style=\'line-height: 1.2; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>De manera que el juego se desarroll&oacute; en las 5 pr&aacute;cticas de la asignatura.</span></p>\r\n<p dir=\'ltr\' style=\'line-height: 1.2; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>La financiaci&oacute;n para el desarrollo del tablero, las fichas y las tarjetas se realiz&oacute; a trav&eacute;s del Departamento de Enfermer&iacute;a y Fisioterapia, utilizando la partida destinada espec&iacute;ficamente al material docente.</span></p>\r\n<p><span id=\'docs-internal-guid-b2887160-7fff-8e69-0cf2-7b93f011eacb\'>&nbsp;</span></p>\r\n<p dir=\'ltr\' style=\'line-height: 1.2; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>Todos los autores de la obra son profesores contratados por la Universidad de Le&oacute;n a tiempo completo, en cuanto a las aportaciones a la obra, la autora principal conceptualiz&oacute; la idea, mientras que el resto de los autores colaboraron en el desarrollo integral del juego, dise&ntilde;o y en la creaci&oacute;n de contenidos.</span></p>','2024-11-28 09:53:28'),(553,142,1,NULL,'ESTIMACIÓN DEL COSTE DE OBTENCIÓN (GASTO DE ACTIVACIÓN)','<p>0</p>','2024-11-28 09:53:56'),(554,113,46,NULL,'14/11/2022 A 31/10/2022 consulta presupuesto y actuaciones a CLARKE','<p>correos intercambiados <a href=\'../../cdn/admin/assets/solicitudes/1214/113/46/TaZnrApED3Ozcvt5KNSI.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 221114 a 1031_correos_estudio inicial infracci&oacute;n.pdf </a>&nbsp;</p>\r\n<p>ESTADO: CERRADO</p>\r\n<p>&nbsp;</p>','2024-11-28 10:33:48'),(555,113,46,NULL,'19/9/2024