 tema que pudieran precisar, pueden ponerse en contacto con nosotros.</span></p>\r\n<p style=\'margin: 0cm; text-align: justify; line-height: 107%;\'><span style=\'font-size: 11.0pt; line-height: 107%; font-family: \'Avenir Next LT Pro\',sans-serif; mso-bidi-font-family: Arial;\'>&nbsp;</span></p>\r\n<p style=\'margin: 0cm; text-align: justify; line-height: 107%;\'><span style=\'font-size: 11.0pt; line-height: 107%; font-family: \'Avenir Next LT Pro\',sans-serif; mso-bidi-font-family: Arial;\'>Aprovechamos la ocasi&oacute;n para enviarles un cordial saludo.</span></p>\r\n<p style=\'margin: 0cm; text-align: justify; line-height: 107%;\'><span style=\'font-size: 11.0pt; line-height: 107%; font-family: \'Avenir Next LT Pro\',sans-serif; mso-bidi-font-family: Arial;\'>&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\'margin: 0cm; text-align: justify; line-height: 107%;\'><span style=\'font-size: 11.0pt; line-height: 107%; font-family: \'Avenir Next LT Pro\',sans-serif; mso-bidi-font-family: Arial;\'>Atentamente,</span></p>\r\n<p>&nbsp;</p>\r\n<p><a href=\'../../cdn/admin/assets/solicitudes/24/404/7/G9lkxidZcYXMTaSFjp1s.msg\' target=\'_blank\' rel=\'noopener\'>U202131032Enlace al documento: Publicaci&oacute;n del Modelo de Utilidad n&uacute;mero 202431055_ a nombre de UNIVERSIDAD DE LEON_ UNIVERSIDAD DE SALAMANCA.msg </a>&nbsp;</p>\r\n<p><a href=\'../../cdn/admin/assets/solicitudes/24/404/7/D2KrSlbimOXVqjdH9oZw.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: alfaDOC_1110U_202431055_24_11_05_12_02_00.pdf </a>&nbsp;</p>','2024-11-29 12:42:31'),(559,404,6,NULL,'FACTURA SOLICITUD','<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/24/404/6/h9fdkEXpmTPuRUWZL2nA.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 263725 ESTADO CUENTA _Universidad de Le&oacute;n.msg </a>&nbsp;</p>\r\n<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/24/404/6/yiAzlndpFo13ORQXJP7H.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Factura venta FV-24-1009