entado esta ma&ntilde;ana, env&iacute;o un resumen de nuestra reuni&oacute;n, junto con los enlaces a los formularios necesarios para realizar la <strong>comunicaci&oacute;n de invenci&oacute;n</strong> (en este caso, de patente).</p>\r\n<p>Como resumen de lo comentado, hago un repaso:</p>\r\n<h3>1. V&iacute;as de protecci&oacute;n</h3>\r\n<p>Hemos planteado las distintas v&iacute;as de protecci&oacute;n por propiedad intelectual e industrial:</p>\r\n<ul type=\'disc\'>\r\n<li class=\'MsoNormal\'><strong>Industrial</strong>:</li>\r\n<ul type=\'circle\'>\r\n<li class=\'MsoNormal\'>Patentes</li>\r\n<li class=\'MsoNormal\'>Modelos de utilidad</li>\r\n<li class=\'MsoNormal\'>Dise&ntilde;os</li>\r\n<li class=\'MsoNormal\'>Marcas</li>\r\n<li class=\'MsoNormal\'>...</li>\r\n</ul>\r\n<li class=\'MsoNormal\'><strong>Intelectual</strong>:</li>\r\n<ul type=\'circle\'>\r\n<li class=\'MsoNormal\'>Software</li>\r\n<li class=\'MsoNormal\'>Bases de datos</li>\r\n<li class=\'MsoNormal\'>Conjuntos de datos</li>\r\n</ul>\r\n</ul>\r\n<p>Tambi&eacute;n hemos hablado del <strong>secreto empresarial</strong> como alternativa cuando la explotaci&oacute;n lo requiera.</p>\r\n<h3>2. Alumnos y vinculaci&oacute;n laboral</h3>\r\n<p>En relaci&oacute;n con la autor&iacute;a, hemos comentado que, si la invenci&oacute;n es el resultado de una <strong>tesis</strong> en la que los tutores han tenido una participaci&oacute;n activa, deber&aacute; justificarse este hecho en la comunicaci&oacute;n de invenci&oacute;n, reflejando los porcentajes de autor&iacute;a de cada participante.</p>\r\n<ul type=\'disc\'>\r\n<li class=\'MsoNormal\'>En el caso de las <strong>tesis doctorales</strong>, los alumnos con vinculaci&oacute;n laboral con la ULE no necesitan firmar ning&uacute;n documento adicional.</li>\r\n<li class=\'MsoNormal\'>Si no tienen vinculaci&oacute;n laboral, es necesario que firmen el documento <strong>&ldquo;47.2 Cesi&oacute;n de Derechos de Propiedad Industrial&rdquo;</strong>, o que se justifique una cotitularidad de la invenci&oacute;n. Este &uacute;ltimo caso debe reflejarse en el formulario de cotitularidad indicando los porcentajes correspondientes.</li>\r\n</ul>\r\n<p>Puedes descargar los formularios en los siguientes enlaces:</p>\r\n<ul type=\'disc\'>\r\n<li class=\'MsoNormal\'><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/47_2_20230829.docx\' target=\'_blank\' rel=\'noopener\'>47.2 Cesi&oacute;n de Derechos de Propiedad Industrial</a></li>\r\n<li class=\'MsoNormal\'><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/47_1_v20201_20210416.docx\' target=\'_blank\' rel=\'noopener\'>47.1 Acuerdo de Cotitularidad</a></li>\r\n</ul>\r\n<h3>Confidencialidad en tesis doctorales</h3>\r\n<p>En el caso de <strong>tesis doctorales</strong>, est&aacute;n disponibles los siguientes <strong>impresos de confidencialidad</strong>:</p>\r\n<ul type=\'disc\'>\r\n<li class=\'MsoNormal\'><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/confidencialidad_tesis_20230908.doc\' target=\'_blank\' rel=\'noopener\'>32 Solicitud de confidencialidad en la defensa de la tesis</a></li>\r\n<li class=\'MsoNormal\'><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/confidencialidad_tribunal20200117.doc\' target=\'_blank\' rel=\'noopener\'>Compromiso de confidencialidad del tribunal de defensa de la tesis</a></li>\r\n</ul>\r\n<h3>3. Procedimiento de protecci&oacute;n</h3>\r\n<p>Hemos repasado el procedimiento, que comienza con la <strong>comunicaci&oacute;n de invenci&oacute;n</strong>. Aunque tomamos como referencia una patente, este proceso aplica a cualquier modalidad de protecci&oacute;n. En el caso de patente, el formulario es el <strong>47 Comunicaci&oacute;n de Invenciones</strong>, que puedes descargar aqu&iacute;:</p>\r\n<ul type=\'disc\'>\r\n<li class=\'MsoNormal\'>47 Comunicaci&oacute;n de Invenciones</li>\r\n</ul>\r\n<h3>4. Costes de la patente</h3>\r\n<p>Hemos hablado tambi&eacute;n de los costes asociados a una patente:</p>\r\n<ul type=\'disc\'>\r\n<li class=\'MsoNormal\'><strong>Solicitud inicial</strong>: entre 2.000 y 3.000 euros.</li>\r\n<li class=\'MsoNormal\'><strong>Extensi&oacute;n internacional (PCT)</strong> en el mes 12: alrededor de 6.000 euros.</li>\r\n<li class=\'MsoNormal\'><strong>Decisi&oacute;n de pa&iacute;ses</strong> en el mes 32: costes variables dependiendo de los pa&iacute;ses seleccionados.</li>\r\n</ul>\r\n<p>Ser&aacute; necesario indicar en la comunicaci&oacute;n de invenci&oacute;n qui&eacute;n asumir&aacute; los gastos correspondientes seg&uacute;n el <strong>Reglamento de Contratos vigente</strong> (art&iacute;culo 8.13), que puedes consultar aqu&iacute;:</p>\r\n<ul type=\'disc\'>\r\n<li class=\'MsoNormal\'><a href=\'https://www.unileon.es/modelos/archivo/norregint/20060107131126Contratos,conveniosyproyectosdeinvestigacion.Reglamento.doc\' target=\'_blank\' rel=\'noopener\'>Reglamento de Contratos</a></li>\r\n</ul>\r\n<h3>5. Otras formas de protecci&oacute;n</h3>\r\n<p>Tambi&eacute;n comentamos que existen otras opciones de protecci&oacute;n por v&iacute;a de <strong>propiedad intelectual</strong> (software, bases de datos, conjuntos de datos). Para estas modalidades, el formulario a utilizar es el <strong>65 Comunicaci&oacute;n de Registro de Propiedad Intelectual</strong>, acompa&ntilde;ado de la documentaci&oacute;n de los autores, que enviar&eacute; cuando se inicie el proceso.</p>\r\n<p>Puedes descargar el formulario aqu&iacute;:</p>\r\n<ul type=\'disc\'>\r\n<li class=\'MsoNormal\'>65 Comunicaci&oacute;n de Registro de Propiedad Intelectual</li>\r\n</ul>\r\n<h3>6. Promoci&oacute;n y transferencia</h3>\r\n<p>En la <strong>OTC</strong> contamos con un &aacute;rea de <strong>promoci&oacute;n</strong>, que realiza actuaciones dirigidas a la <strong>transferencia efectiva de los resultados</strong>. Adem&aacute;s, desde la <strong>FGULEM</strong> se llevan a cabo acciones dentro del <strong>PATCO (Plan de Apoyo a la Transferencia del Conocimiento)</strong>, como las convocatorias de <strong>Pruebas de Concepto (POC)</strong>, que pueden ser de inter&eacute;s.</p>\r\n<p>Puedes encontrar m&aacute;s informaci&oacute;n sobre el PATCO aqu&iacute;:</p>\r\n<ul type=\'disc\'>\r\n<li class=\'MsoNormal\'><a href=\'https://fgulem.unileon.es/patco/\' target=\'_blank\' rel=\'noopener\'>PATCO - Plan de Apoyo a la Transferencia del Conocimiento</a></li>\r\n</ul>\r\n<p>Actualmente estamos preparando la versi&oacute;n del pr&oacute;ximo a&ntilde;o, pero este enlace te permitir&aacute; hacerte una idea de todo lo que se ofrece.</p>\r\n<p>En caso de que se decida que la <strong>v&iacute;a de explotaci&oacute;n</strong> sea la creaci&oacute;n de una <strong>Empresa Basada en el Conocimiento (EBC)</strong>, la ULE dispone de toda la normativa e impresos necesarios para facilitar el proceso. Es importante se&ntilde;alar que estas empresas deben contar con un profesor de la ULE implicado para ser consideradas EBC.</p>\r\n<h3>7. Preservaci&oacute;n de la novedad</h3>\r\n<p>Finalmente, reiteramos la importancia de <strong>preservar la novedad de la invenci&oacute;n</strong> durante todo el proceso, evitando cualquier divulgaci&oacute;n que pueda comprometer su protecci&oacute;n.</p>\r\n<p>Quedo a tu disposici&oacute;n para resolver cualquier duda que pueda surgir durante el proceso de cumplimentaci&oacute;n de estos documentos o sobre cualquier otro aspecto relacionado con la protecci&oacute;n.</p>\r\n<p>Quedo a la espera de tus noticias.</p>\r\n<p class=\'MsoNormal\' style=\'mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify;\'>_____________________________________________________________________________</p>\r\n<p>14/12/2024_ip a mjb_mail:gracias. <a href=\'../../cdn/admin/assets/solicitudes/1594/511/1/Kp8nbBdGUjl5AxsQECDR.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Re_ Resumen de nuestra reuni&oacute;n y enlaces a los formularios necesarios.msg </a>&nbsp;</p>\r\n<p>__________________________________________________________________________</p>','2024-12-04 13:29:08'),(565,513,1,NULL,'Fecha MAIL TRAS PRIMERA REUNION  - INFO GENERAL','<p><strong>Asunto:</strong> Resumen de nuestra reuni&oacute;n y pasos a seguir para la protecci&oacute;n de bases de datos</p>\r\n<p>Estimados xxxxxx</p>\r\n<p>Quiero agradecerles el tiempo dedicado a nuestra reuni&oacute;n reciente y la informaci&oacute;n compartida sobre los proyectos de bases de datos en los que est&aacute;n trabajando. A continuaci&oacute;n, les env&iacute;o un resumen de los puntos tratados y los pasos a seguir para avanzar en el proceso de protecci&oacute;n de estos intangibles:</p>\r\n<h3><strong>Resumen de la reuni&oacute;n</strong></h3>\r\n<ol>\r\n<li>\r\n<p><strong>Proyectos presentados</strong><br />Nos presentaron dos proyectos de bases de datos. Para ambos, deber&aacute;n realizar una <strong>comunicaci&oacute;n de invenci&oacute;n</strong> individual, la cual debe ser enviada a la OTC. Estas comunicaciones deben incluir:</p>\r\n<ul>\r\n<li>Una justificaci&oacute;n de la trayectoria investigadora que ha llevado a la creaci&oacute;n de cada base de datos.</li>\r\n<li>El valor y las posibilidades de transferencia o uso de estas bases por la sociedad.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p><strong>Titularidad</strong><br />Aunque el Archivo Hist&oacute;rico de Le&oacute;n ha facilitado acceso a ciertos recursos, la autor&iacute;a es 100% de ustedes, lo que confirma que la titularidad pertenece &iacute;ntegramente a la ULE.</p>\r\n</li>\r\n<li>\r\n<p><strong>Estructura de la base de datos</strong><br />La base de datos cuenta con un motor de b&uacute;squeda propio, sin software asociado. Es importante facilitar la estructura vac&iacute;a de la base, ya que el contenido ser&aacute; protegido como <strong>dataset</strong>, empleando un modelo de propiedad intelectual distinto. Adjuntamos los enlaces a los modelos correspondientes.</p>\r\n</li>\r\n<li>\r\n<p><strong>Software utilizado</strong><br />En la elaboraci&oacute;n de las bases de datos, se utiliz&oacute; un software de gesti&oacute;n de colecciones. Esto implica que, al licenciar la base de datos (bien remunerada, bien para uso), ser&aacute; necesario revisar las licencias que se heredan de dicho software.</p>\r\n</li>\r\n<li>\r\n<p><strong>Estado actual y futuro repositorio</strong><br />Actualmente, las bases de datos est&aacute;n en abierto. Liliana mencion&oacute; que consultar&aacute; al respecto, ya que desde la OTC se contempla la creaci&oacute;n de un repositorio que podr&iacute;a ser &uacute;til para este y otros proyectos.</p>\r\n</li>\r\n<li>\r\n<p><strong>Jornada en la Facultad</strong><br />Liliana tambi&eacute;n record&oacute; la existencia del PATCO y propuso organizar una jornada en la Facultad para presentar esta iniciativa. El Decano mostr&oacute; una actitud positiva hacia la colaboraci&oacute;n.</p>\r\n</li>\r\n<li>\r\n<p><strong>Procedimiento a seguir</strong><br />Durante la reuni&oacute;n, explicamos las fases del procedimiento:</p>\r\n<ul>\r\n<li>Realizaci&oacute;n de la <strong>comunicaci&oacute;n de invenci&oacute;n</strong>.</li>\r\n<li>Revisi&oacute;n por la <strong>Comisi&oacute;n de Investigaci&oacute;n</strong>.</li>\r\n<li>Registro y certificaci&oacute;n de los intangibles.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p><strong>Asesoramiento en licencias</strong><br />Posteriormente, nuestra compa&ntilde;era de promoci&oacute;n podr&aacute; asesorarles sobre las licencias aplicables, ya sean <strong>Creative Commons</strong>, remuneradas o de uso. Les recordamos la importancia de contar con los documentos necesarios para acreditar los m&eacute;ritos asociados.</p>\r\n</li>\r\n</ol>\r\n<h3><strong>Pasos a realizar ahora</strong></h3>\r\n<ol>\r\n<li>Completar las comunicaciones de invenci&oacute;n para cada base de datos y enviarlas a la OTC.</li>\r\n<li>Justificar en dichas comunicaciones la trayectoria investigadora, el valor de las bases de datos y su potencial de transferencia.</li>\r\n<li>Revisar las licencias asociadas al software de gesti&oacute;n utilizado en la creaci&oacute;n de las bases.</li>\r\n</ol>\r\n<h3><strong>Enlaces a los formularios</strong></h3>\r\n<ul>\r\n<li><strong>Formulario 65 - Comunicaci&oacute;n de Registro de Propiedad Intelectual:</strong> <a href=\'#\' rel=\'noopener\'>Descargar aqu&iacute;</a>.</li>\r\n<li><strong>Informaci&oacute;n sobre licencias y datasets:</strong> <a href=\'#\' rel=\'noopener\'>Descargar aqu&iacute;</a>.</li>\r\n</ul>\r\n<p>Estamos a su disposici&oacute;n para cualquier duda o aclaraci&oacute;n durante este proceso. Una vez que tengamos las comunicaciones de invenci&oacute;n, podemos avanzar con las siguientes fases.</p>\r\n<p>Reciban un cordial saludo,<br />[Tu Nombre]<br />[Tu Cargo]<br />[Tu Organizaci&oacute;n]<br />[Datos de contacto, si aplican]</p>','2024-12-05 09:47:24'),(566,512,1,NULL,'28/11/2024 PRIMERA REUNION','','2024-12-05 10:17:03'),(567,512,1,207,'5/12/2024_mail_resumen reunión y pasos a seguir para la protección de bases de datos','<p>5/12/2024 MJB A IP_ <a href=\'../../cdn/admin/assets/solicitudes/1097/512/1/48dXZzfe1xL0PU2RNsDw.msg\' target=\'_blank\' rel=\'noopener\'>mail.msg </a>&nbsp;</p>\r\n<p>ASUNTO: Resumen de nuestra reuni&oacute;n y pasos a seguir para la protecci&oacute;n de bases de datos</p>\r\n<p>TEXTO:&nbsp;</p>\r\n<p>Estimados Santiago, Javier y Luisa,</p>\r\n<p>Como continuaci&oacute;n a la reuni&oacute;n que mantuvimos, env&iacute;o un resumen de los puntos tratados y los pasos a seguir para avanzar en el proceso de protecci&oacute;n de bases de datos:&nbsp;</p>\r\n<p><strong>Resumen de la reuni&oacute;n</strong></p>\r\n<ol start=\'1\' type=\'1\'>\r\n<li><strong>Proyectos presentados</strong><br />Fueron presentados dos proyectos de bases de datos. Para ambos, deber&aacute;n realizar una <strong>comunicaci&oacute;n de invenci&oacute;n</strong> individual, la cual debe ser enviada a la OTC. Estas comunicaciones deben incluir:</li>\r\n<ul type=\'circle\'>\r\n<li class=\'MsoNormal\'>Una justificaci&oacute;n de la trayectoria investigadora que ha llevado a la creaci&oacute;n de cada base de datos.</li>\r\n<li class=\'MsoNormal\'>El valor de cada base de datos y las posibilidades de transferencia o uso de &eacute;stas bases por la sociedad.</li>\r\n</ul>\r\n<li><strong>Titularidad</strong><br />La titularidad correspondera&nbsp;a la ULE en un 100%.&nbsp;</li>\r\n<li><strong>Estructura de la base de datos</strong><br />La base de datos cuenta con un motor de b&uacute;squeda propio, sin software asociado. Es importante facilitar la estructura vac&iacute;a de la base, ya que el contenido ser&aacute; protegido como <strong>dataset</strong>, empleando un modelo de propiedad intelectual distinto. Adjuntamos los enlaces a los modelos correspondientes.</li>\r\n<li><strong>Software utilizado</strong><br />En la elaboraci&oacute;n de las bases de datos, se utiliz&oacute; un software de gesti&oacute;n de colecciones. Esto implica que, al licenciar la base de datos (bien remunerada, bien para uso), ser&aacute; necesario revisar las licencias que se heredan de dicho software. Deber&aacute; tenerse en cuenta cuando se contacte con la compa&ntilde;era de promo.&nbsp;</li>\r\n<li><strong>Estado actual y futuro repositorio</strong><br />Actualmente, las bases de datos est&aacute;n en abierto. Liliana mencion&oacute; que realizar&aacute; alguna consulta al respecto, ya que desde la OTC se contempla la creaci&oacute;n de un repositorio que podr&iacute;a ser &uacute;til para este y otros proyectos.</li>\r\n<li><strong>Jornada en la Facultad</strong><br />Liliana tambi&eacute;n record&oacute; la existencia del PATCO y propuso organizar una jornada en la Facultad para presentar esta iniciativa. El Decano mostr&oacute; una actitud positiva hacia la colaboraci&oacute;n.</li>\r\n<li><strong>Procedimiento a seguir</strong><br />Durante la reuni&oacute;n, explicamos las fases del procedimiento:</li>\r\n<ul type=\'circle\'>\r\n<li class=\'MsoNormal\'>Realizaci&oacute;n de la <strong>comunicaci&oacute;n de invenci&oacute;n</strong>.</li>\r\n<li class=\'MsoNormal\'>Revisi&oacute;n por la <strong>Comisi&oacute;n de Investigaci&oacute;n</strong>.</li>\r\n<li class=\'MsoNormal\'>Registro y certificaci&oacute;n de los intangibles.</li>\r\n</ul>\r\n<li><strong>Asesoramiento en licencias</strong><br />Posteriormente, nuestra compa&ntilde;era de promoci&oacute;n podr&aacute; asesorarles sobre las licencias aplicables, ya sean <strong>Creative Commons</strong>, remuneradas o de uso. Les recordamos la importancia de contar con los documentos necesarios para acreditar los m&eacute;ritos asociados.</li>\r\n</ol>\r\n<h3><strong>Pasos a realizar ahora</strong></h3>\r\n<ol start=\'1\' type=\'1\'>\r\n<li class=\'MsoNormal\'>Completar las comunicaciones de invenci&oacute;n para cada base de datos y enviarlas a la OTC.</li>\r\n<li class=\'MsoNormal\'>Justificar en dichas comunicaciones la trayectoria investigadora, el valor de las bases de datos y su potencial de transferencia.</li>\r\n<li class=\'MsoNormal\'>Revisar las licencias asociadas al software de gesti&oacute;n utilizado en la creaci&oacute;n de las bases.</li>\r\n</ol>\r\n<h3><strong>Enlaces a los formularios</strong></h3>\r\n<ul type=\'disc\'>\r\n<li class=\'MsoNormal\'>&nbsp;</li>\r\n</ul>\r\n<table class=\'MsoNormalTable\' style=\'width: 855pt; margin-left: 36pt; background: #fafafa; border: none; border-spacing: 0px; max-width: 100%; border-radius: 0px;\' border=\'1\' width=\'1140\' cellspacing=\'0\' cellpadding=\'0\'>\r\n<tbody>\r\n<tr style=\'mso-yfti-irow: 0; mso-yfti-firstrow: yes; mso-yfti-lastrow: yes; box-sizing: border-box;\'>\r\n<td style=\'border-top-width: 1pt; border-top-color: gray; border-left: none; border-bottom-width: 1pt; border-bottom-color: #999999; border-right: none; padding: 6pt; box-sizing: border-box; border-radius: 0px;\' valign=\'top\'>\r\n<p class=\'MsoNormal\' style=\'margin-bottom: 12.0pt;\'>65</p>\r\n</td>\r\n<td 