x\'><span style=\'color: #337ab7;\'>Declaraci&oacute;n autor base de datos y otros (no programas de ordenador). Seg&uacute;n Art 97.4 TRLPI</span></a></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<ul style=\'margin-top: 0cm;\' type=\'disc\'>\r\n<li class=\'MsoNormal\' style=\'mso-list: l0 level1 lfo3; display: none; tab-stops: list 36.0pt;\'><span style=\'display: none; mso-hide: all;\'>&nbsp;</span></li>\r\n<li class=\'MsoNormal\'>&nbsp;</li>\r\n</ul>\r\n<table class=\'MsoNormalTable\' style=\'width: 855pt; margin-left: 36pt; background: #fafafa; border: none; border-spacing: 0px; max-width: 100%; border-radius: 0px;\' border=\'1\' width=\'1140\' cellspacing=\'0\' cellpadding=\'0\'>\r\n<tbody>\r\n<tr style=\'mso-yfti-irow: 0; mso-yfti-firstrow: yes; mso-yfti-lastrow: yes; box-sizing: border-box;\'>\r\n<td style=\'border-top-width: 1pt; border-top-color: gray; border-left: none; border-bottom-width: 1pt; border-bottom-color: #999999; border-right: none; padding: 6pt; box-sizing: border-box; border-radius: 0px;\' valign=\'top\'>\r\n<p class=\'MsoNormal\' style=\'margin-bottom: 12.0pt;\'>66</p>\r\n</td>\r\n<td style=\'border-top-width: 1pt; border-top-color: gray; border-left: none; border-bottom-width: 1pt; border-bottom-color: #999999; border-right: none; padding: 6pt; box-sizing: border-box; border-radius: 0px;\' valign=\'top\'>\r\n<p class=\'MsoNormal\' style=\'margin-bottom: 12.0pt;\'><a style=\'box-sizing: border-box; text-decoration-line: none; border-radius: 0px;\' href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/66_v01_OC_DATASETS_20231019.docx\'><span style=\'color: #337ab7;\'>Comunicaci&oacute;n de Registro de Propiedad Intelectual &ndash; PAQUETE DE DATOS O &ldquo;DATASETS&rdquo;</span></a></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Estamos a su disposici&oacute;n para cualquier duda o aclaraci&oacute;n durante este proceso. Una vez que tengamos las comunicaciones de invenci&oacute;n, podemos avanzar con las siguientes fases.</p>\r\n<p>Recibir un saludo,&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>5/12/2025_m luisa_gracias <a href=\'../../cdn/admin/assets/solicitudes/1097/512/1/6gle1xkXI9MvAO4Yd0wL.msg\' target=\'_blank\' rel=\'noopener\'>mail.msg </a>&nbsp;</p>\r\n<p>5/12/2025_santiago a mjb_gracias _ <a href=\'../../cdn/admin/assets/solicitudes/1097/512/1/GxRiBMs0zm7u8VAE2lXj.msg\' target=\'_blank\' rel=\'noopener\'>mail.msg </a>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','2024-12-05 10:17:39'),(568,511,1,NULL,'','','2024-12-05 10:38:48'),(569,404,2,4,'08/07/2024_PRESENTACIÓN COMUNICACIÓN DE INVENCIÓN','<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/24/404/2/1GxLFDSoBuyEwXOl7m80.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 240708_V01_COMUNICACI&Oacute;N DE INVENCI&Oacute;N.pdf </a>&nbsp;</p>','2024-12-05 11:22:20'),(570,404,2,5,'10/07/2024 PRESENTACIÓN DOCUMENTACIÓN A COMISIÓN INVESTIGACIÓN','<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/1429/404/2/2hf9UT6jXpJxVb0ZzycI.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 240710_OFICIO OTC A COMISION DE INVESTIGACION.report.pdf </a>&nbsp;</p>','2024-12-05 11:27:17'),(571,404,2,18,'18/07/2024 COMISIÓN DE INVESTIGACIÓN - DECISIÓN - AUTORIZACIÓN','<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/1429/404/2/txaRpdyu3PBf8blrD7oY.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 240718_ 6-acuerdos sesi&oacute;n_CI_18-07-2024.pdf </a>&nbsp;</p>','2024-12-05 11:28:22'),(572,404,6,NULL,'04/06/2024 DEPOSITO SOLICITUD EN LA OEPM','<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/1429/404/6/ceDx9sJ705Mbvl2Ui3Ez.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: U202431055.pdf </a>&nbsp;</p>','2024-12-05 11:31:31'),(573,404,6,134,'05/12/2024 REPORTE INDICADOR A FGULEM','<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/1429/404/6/ATGrgI1NEOF9P5zfHDMk.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: NUEVO DEPOSITO MDU.msg </a>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>7/12/2024 mjb a vero_mail&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1429/404/6/dycB7rMGOP6Vm29aWoJk.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: NUEVO DEPOSITO MDU.msg </a>&nbsp;</p>','2024-12-05 11:33:48'),(574,404,7,NULL,'NO TIENE FACTURA','','2024-12-05 11:56:48'),(575,514,1,NULL,'23/05/2024 a xxx ASESORAMIENTO PREVIOS','<p>1&ordf; REUNION <a href=\'../../cdn/admin/assets/solicitudes/1493/514/1/dMlaAut6jZOpC705NUcL.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: reunion.pdf</a></p>\r\n<p>pidieron una poc, BD REGISTRATA, ahora la empresa quiere hacer una calculadora de riesgo (la empresa que hace realizad virtual). ofrecieron a la empresa hacer un proyecto PRISMA</p>\r\n<p>EXPLICO PROCESOS, PLANTILLAS.... ETC</p>\r\n<p>29/05/2024 <a href=\'../../cdn/admin/assets/solicitudes/1493/514/1/PhadIwF9GKt7QB4spL2R.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 240529_ENV&Iacute;O PLANTILLAS.msg </a>&nbsp;</p>\r\n<p>29/05/2024&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1493/514/1/cz41ydInMfXo8jlRw5E9.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 240529_ip a mjb.msg </a>&nbsp;</p>','2024-12-05 12:49:57'),(576,508,1,NULL,'10/09/2024 a xxx ASESORAMIENTOS PREVIOS','<p>10/09/2024&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1493/508/1/rzmtXdQyvfgCVShInRBJ.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: RV_ consulta.msg </a>&nbsp;</p>\r\n<p>La directora de las BECAS RALBAR consulta por la protecci&oacute;n de resultados de los becarios.&nbsp;</p>\r\n<p>11/9/2024 consulto con LILIANA&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1493/508/1/MaSpGKxQN2OjIzgvfhRA.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Re_ consulta.msg </a>&nbsp;</p>\r\n<p>20/9/2024 respondo a Ana con informaci&oacute;n sobre la protecci&oacute;n en un mail detallado.&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1493/508/1/7126aUTDCeRrkvEcO0u3.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Consulta sobre el Registro de los _Productos de las Becas RALBAR_.msg </a>&nbsp;</p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>Hola Ana&iexcl; </span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>&nbsp;</span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>Muchas gracias por enviarme la informaci&oacute;n sobre las becas <strong>RALBAR</strong> y los agentes involucrados en los proyectos. Cuando quieras nos vemos, y lo comentamos con m&aacute;s detalle, pero te adelanto mi primera impresi&oacute;n. </span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>&nbsp;</span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>He revisado la convocatoria, y para el registro de los \'productos\' generados en el marco de las becas, <u>siempre deben poder ser objeto de transferencia</u>. Ya sabes, que los &nbsp;REA se proteger&iacute;an por copyright y se atribuir&iacute;an licencias tipo creative commons. </span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>&nbsp;</span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>Por otro lado, productos exclusivamente desarrollados por estudiantes, no general derechos de titularidad a la ULE, s&iacute; aquellos en los que ha participado el PDI o en la convocatoria se indicara de forma expresa. En el caso de la convocatoria RALBAR, habla de pr&aacute;cticas para el desarrollo de proyectos, en colaboraci&oacute;n con terceros, por lo que los derechos de explotaci&oacute;n van a tener que aclararse en cada caso. No se que implica el concepto &ldquo;proyecto&rdquo; o que mejoras t&eacute;cnicas con potencial transferencia pod&eacute;is haber desarrollado y en qu&eacute; t&eacute;rminos se han realizado las colaboraciones. Tambi&eacute;n supongo que la &ldquo;tutorizaci&oacute;n&rdquo; ha tenido sus particularidades en cada caso y que hay que tener en cuenta adem&aacute;s que en las bases se menciona &ldquo;Si de las pr&aacute;cticas derivara alg&uacute;n resultado intelectual susceptible de ser publicado, el autor/a deber&aacute; hacer constar la ayuda financiera recibida a trav&eacute;s del programa de Becas Ralbar de la Universidad de Le&oacute;n (con la colaboraci&oacute;n de la Fundaci&oacute;n Banco Sabadell).&rdquo;.</span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>&nbsp;</span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>En el caso, de derechos de explotaci&oacute;n en los que participe la ULE, el procedimiento ser&iacute;a el general. &nbsp;</span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>&nbsp;</span></p>\r\n<ol style=\'margin-top: 0cm;\' start=\'1\' type=\'1\'>\r\n<li class=\'MsoNormal\'><strong><span style=\'font-size: 11.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-US;\'>Propiedad Intelectual de los Productos</span></strong><span style=\'font-size: 11.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-US;\'>:<br />Es posible proceder con el registro<strong> como propiedad intelectual</strong>. Para ello, deber&aacute;n seguir el procedimiento establecido por la <strong>Oficina de Transferencia de Conocimiento (OTC)</strong>, utilizando la plantilla de <strong>comunicaci&oacute;n de registro de propiedad intelectual</strong>.</span></li>\r\n</ol>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>&nbsp;</span></p>\r\n<table class=\'MsoNormalTable\' style=\'width: 855pt; background: #fafafa;\' border=\'0\' width=\'1140\' cellspacing=\'0\' cellpadding=\'0\'>\r\n<tbody>\r\n<tr>\r\n<td style=\'border: none; border-top: solid gray 1.0pt; padding: 6.0pt 6.0pt 6.0pt 6.0pt;\' valign=\'top\'>\r\n<ol style=\'margin-top: 0cm;\' start=\'1\' type=\'1\'>\r\n<ul style=\'margin-top: 0cm;\' type=\'circle\'>\r\n<li class=\'MsoNormal\'><span style=\'font-size: 11pt;\'>65</span></li>\r\n</ul>\r\n</ol>\r\n</td>\r\n<td style=\'border: none; border-top: solid gray 1.0pt; padding: 6.0pt 6.0pt 6.0pt 6.0pt;\' valign=\'top\'>\r\n<ol style=\'margin-top: 0cm;\' start=\'1\' type=\'1\'>\r\n<ul style=\'margin-top: 0cm;\' type=\'circle\'>\r\n<li class=\'MsoNormal\'><span style=\'font-size: 11pt;\'><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/65_v2024_20240424.docx\'>Comunicaci&oacute;n de Registro de Propiedad Intelectual</a></span></li>\r\n</ul>\r\n</ol>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\'border: none; border-top: solid gray 1.0pt; padding: 6.0pt 6.0pt 6.0pt 6.0pt;\' valign=\'top\'>\r\n<ol style=\'margin-top: 0cm;\' start=\'1\' type=\'1\'>\r\n<ul style=\'margin-top: 0cm;\' type=\'circle\'>\r\n<li class=\'MsoNormal\'><span style=\'font-size: 11pt;\'>65.3</span></li>\r\n</ul>\r\n</ol>\r\n</td>\r\n<td style=\'border: none; border-top: solid gray 1.0pt; padding: 6.0pt 6.0pt 6.0pt 6.0pt;\' valign=\'top\'>\r\n<ol style=\'margin-top: 0cm;\' start=\'1\' type=\'1\'>\r\n<ul style=\'margin-top: 0cm;\' type=\'circle\'>\r\n<li class=\'MsoNormal\'><span style=\'font-size: 11pt;\'><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/65_3_v230411.docx\'>Declaraci&oacute;n autor base de datos y otros (no programas de ordenador). Seg&uacute;n Art 97.4 TRLPI</a></span></li>\r\n</ul>\r\n</ol>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\'border: none; border-top: solid gray 1.0pt; padding: 6.0pt 6.0pt 6.0pt 6.0pt;\' valign=\'top\'>\r\n<ol style=\'margin-top: 0cm;\' start=\'1\' type=\'1\'>\r\n<ul style=\'margin-top: 0cm;\' type=\'circle\'>\r\n<li class=\'MsoNormal\'><span style=\'font-size: 11pt;\'>65.5</span></li>\r\n</ul>\r\n</ol>\r\n</td>\r\n<td style=\'border: none; border-top: solid gray 1.0pt; padding: 6.0pt 6.0pt 6.0pt 6.0pt;\' valign=\'top\'>\r\n<ol style=\'margin-top: 0cm;\' start=\'1\' type=\'1\'>\r\n<ul style=\'margin-top: 0cm;\' type=\'circle\'>\r\n<li class=\'MsoNormal\'><span style=\'font-size: 11pt;\'><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/65_5_v240717.docx\'>Declaraci&oacute;n autor para programas de ordenador. Seg&uacute;n Art 51.2 TRLPI</a></span></li>\r\n</ul>\r\n</ol>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\'border-top: solid gray 1.0pt; border-left: none; border-bottom: solid #999999 1.0pt; border-right: none; padding: 6.0pt 6.0pt 6.0pt 6.0pt;\' valign=\'top\'>\r\n<ol style=\'margin-top: 0cm;\' start=\'1\' type=\'1\'>\r\n<ul style=\'margin-top: 0cm;\' type=\'circle\'>\r\n<li class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-font-family: \'Times New Roman\'; color: windowtext; mso-color-alt: windowtext; mso-fareast-language: EN-US;\'>&nbsp;</span></li>\r\n</ul>\r\n</ol>\r\n</td>\r\n<td style=\'border-top: solid gray 1.0pt; border-left: none; border-bottom: solid #999999 1.0pt; border-right: none; padding: 6.0pt 6.0pt 6.0pt 6.0pt;\' valign=\'top\'>\r\n<ol style=\'margin-top: 0cm;\' start=\'1\' type=\'1\'>\r\n<ul style=\'margin-top: 0cm;\' type=\'circle\'>\r\n<li class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-font-family: \'Times New Roman\'; color: windowtext; mso-color-alt: windowtext; mso-fareast-language: EN-US;\'>&nbsp;</span></li>\r\n</ul>\r\n</ol>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>&nbsp;</span></p>\r\n<ol style=\'margin-top: 0cm;\' start=\'2\' type=\'1\'>\r\n<li class=\'MsoNormal\'><strong><span style=\'font-size: 11.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-US;\'>Distribuci&oacute;n de Derechos</span></strong><span style=\'font-size: 11.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-US;\'>:<br />Para los proyectos realizados en colaboraci&oacute;n, como es el caso de las becas RALBAR, es necesario definir la participaci&oacute;n de los agentes en la <strong>titularidad de los derechos de explotaci&oacute;n</strong>. En este caso, dado que el estudiante, los tutores y las coordinadoras han contribuido de diferentes maneras, la distribuci&oacute;n de derechos puede ser compartida mediante un <strong>acuerdo de cotitularidad</strong> o bien, mediante la realizaci&oacute;n de una <strong>cesi&oacute;n de derechos</strong> a la ULE.</span></li>\r\n</ol>\r\n<p class=\'MsoNormal\' style=\'margin-left: 18.0pt;\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>&nbsp;</span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>En estos casos, te adjunto el <strong>modelo de acuerdo de cotitularidad</strong> para que lo utilic&eacute;is si decid&iacute;s compartir los derechos entre las partes involucradas y la de cesi&oacute;n. </span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>&nbsp;</span></p>\r\n<table class=\'MsoNormalTable\' style=\'width: 855pt; background: #fafafa;\' border=\'0\' width=\'1140\' cellspacing=\'0\' cellpadding=\'0\'>\r\n<tbody>\r\n<tr>\r\n<td style=\'border: none; border-top: solid gray 1.0pt; padding: 6.0pt 6.0pt 6.0pt 6.0pt;\' valign=\'top\'>\r\n<ol style=\'margin-top: 0cm;\' start=\'2\' type=\'1\'>\r\n<ul style=\'margin-top: 0cm;\' type=\'circle\'>\r\n<li class=\'MsoNormal\'><span style=\'font-size: 11pt;\'>65.6</span></li>\r\n</ul>\r\n</ol>\r\n</td>\r\n<td style=\'border: none; border-top: solid gray 1.0pt; padding: 6.0pt 6.0pt 6.0pt 6.0pt;\' valign=\'top\'>\r\n<ol style=\'margin-top: 0cm;\' start=\'2\' type=\'1\'>\r\n<ul style=\'margin-top: 0cm;\' type=\'circle\'>\r\n<li class=\'MsoNormal\'><span style=\'font-size: 11pt;\'><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/65_6_v230411.docx\'>Modelo cesi&oacute;n derechos</a></span></li>\r\n</ul>\r\n</ol>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\'border-top: solid gray 1.0pt; border-left: none; border-bottom: solid #999999 1.0pt; border-right: none; padding: 6.0pt 6.0pt 6.0pt 6.0pt;\' valign=\'top\'>\r\n<ol style=\'margin-top: 0cm;\' start=\'2\' type=\'1\'>\r\n<ul style=\'margin-top: 0cm;\' type=\'circle\'>\r\n<li class=\'MsoNormal\'><span style=\'font-size: 11pt;\'>65.8</span></li>\r\n</ul>\r\n</ol>\r\n</td>\r\n<td style=\'border-top: solid gray 1.0pt; border-left: none; border-bottom: solid #999999 1.0pt; border-right: none; padding: 6.0pt 6.0pt 6.0pt 6.0pt;\' valign=\'top\'>\r\n<ol style=\'margin-top: 0cm;\' start=\'2\' type=\'1\'>\r\n<ul style=\'margin-top: 0cm;\' type=\'circle\'>\r\n<li class=\'MsoNormal\'><span style=\'font-size: 11pt;\'><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/65_8_v230411.docx\'>Cotitularidad &ndash; Acuerdo de cotitularidad</a></span></li>\r\n</ul>\r\n</ol>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class=\'MsoNormal\' style=\'margin-left: 36.0pt;\'><strong><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>&nbsp;</span></strong></p>\r\n<ol style=\'margin-top: 0cm;\' start=\'3\' type=\'1\'>\r\n<li class=\'MsoListParagraph\' style=\'margin-left: 0cm; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;\'><strong><span style=\'font-size: 11.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-US;\'>Datos Generados durante el Proyecto</span></strong><span style=\'font-size: 11.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-US;\'>:<br />Si durante el desarrollo de los proyectos se generaron <strong>datos</strong> (como bases de datos, registros o material utilizado para entrenar modelos), estos tambi&eacute;n pueden ser protegidos como <strong>datasets</strong>. Para registrar estos datos, pueden utilizar la plantilla correspondiente de comunicaci&oacute;n de datasets.</span></li>\r\n</ol>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>&nbsp;</span></p>\r\n<table class=\'MsoNormalTable\' style=\'width: 855pt; background: #fafafa;\' border=\'0\' width=\'1140\' cellspacing=\'0\' cellpadding=\'0\'>\r\n<tbody>\r\n<tr>\r\n<td style=\'border-top: solid gray 1.0pt; border-left: none; border-bottom: solid #999999 1.0pt; border-right: none; padding: 6.0pt 6.0pt 6.0pt 6.0pt;\' valign=\'top\'>\r\n<ol style=\'margin-top: 0cm;\' start=\'3\' type=\'1\'>\r\n<ul style=\'margin-top: 0cm;\' type=\'circle\'>\r\n<li class=\'MsoNormal\'><span style=\'font-size: 11pt;\'>66</span></li>\r\n</ul>\r\n</ol>\r\n</td>\r\n<td style=\'border-top: solid gray 1.0pt; border-left: none; border-bottom: solid #999999 1.0pt; border-right: none; padding: 6.0pt 6.0pt 6.0pt 6.0pt;\' valign=\'top\'>\r\n<ol style=\'margin-top: 0cm;\' start=\'3\' type=\'1\'>\r\n<ul style=\'margin-top: 0cm;\' type=\'circle\'>\r\n<li class=\'MsoNormal\'><span style=\'font-size: 11pt;\'><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/66_v01_OC_DATASETS_20231019.docx\'>Comunicaci&oacute;n de Registro de Propiedad Intelectual &ndash; PAQUETE DE DATOS O &ldquo;DATASETS&rdquo;</a></span></li>\r\n</ul>\r\n</ol>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class=\'MsoNormal\'><strong><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>&nbsp;</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>Saludos.</span></p>\r\n<p>&nbsp;</p>\r\n<p>23/09/2024 reenv&iacute;o a LH que se me hab&iacute;a olvidado ponerla en copia. <a href=\'../../cdn/admin/assets/solicitudes/1493/508/1/OYm175fBaRdWeDhkVj8l.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: RV_ Consulta sobre el Registro de los _Productos de las Becas RALBAR_.msg </a>&nbsp;</p>\r\n<p>24/09/2024 REUNION en la que explico el mail enviado de forma detallada&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1493/508/1/XcnQESF