t=\'_blank\' rel=\'noopener\'>Enlace al documento: 230712_OEPM_Informe 101581_P9515.msg </a>&nbsp;</p>\r\n<p>ITP&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1288/398/3/jlaOSTpMKkCYd4bJrBmX.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 230712_INFORME ITP P9515.pdf </a>&nbsp;</p>\r\n<p>12/7/2023 REENV&Iacute;O ITP AL INVESTIGADOR&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1288/398/3/E7nO6ivA8h2wosgq9euF.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 230712_MJB A IP_ITP Informe 101581_P9515 emitido para expediente 230602_GONZALO DE GRADO_ JES&Uacute;S_GLOBOS ESTRATOSF&Eacute;RICOS.msg </a>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>EL INVESTIGADOR NO RESPONDI&Oacute;. EL 25/10/2024 RETOMO CONTACTO CON EL IP TRAS LEER EL ITP</p>','2024-12-05 13:10:50'),(579,398,3,117,'25/10/2024 a 5/12/2024 RETOMO CONTACTO CON EL INVESTIGADOR','<p>25/10/2024 analizo el ITP con el chatGPT&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1288/398/3/Z7JgpTNviM0DYhurmdGF.docx\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 241025_analisis de ITP con chatGPT.docx </a>&nbsp;</p>\r\n<p>se lo reenv&iacute;o al investigador&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1288/398/3/I0Li86orQKOEaHgb5yCM.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 241025_mjb a ip_RETOMAR PATENTE GLOBO ESTRATOSFERICO.msg </a>&nbsp;</p>\r\n<p>6/11/2024 Env&iacute;a nueva memoria con correcciones. <a href=\'../../cdn/admin/assets/solicitudes/1288/398/3/kJOcdxEyvB9HNqSYAX86.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Re_ RETOMAR PATENTE GLOBO ESTRATOSFERICO (1).msg </a>&nbsp;</p>\r\n<p>5/12/2024&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1288/398/3/aNVfgRJSMY37iCGPBu1U.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: RE_ RETOMAR PATENTE GLOBO ESTRATOSFERICO (2).msg </a>&nbsp;OK, PIDO PRESUPUESTO A CLARKE&nbsp;</p>','2024-12-05 13:12:53'),(580,398,4,199,'05/12/2024 a Fecha - CONTRATACIÓN CLARKE - PTE CERRAR PRESUPUESTO','<p>correos</p>\r\n<p>5/12/2024 Fecha REMISI&Oacute;N DOC A CLARKE&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1288/398/4/eyqucgUToMa5ziJ8rvQh.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: NUEVA COMUNICACI&Oacute;N DE INVENCI&Oacute;N PARA DEPOSITO PATENTE GLOBO ESTRATOSFERICO (1).msg </a>&nbsp;</p>\r\n<p>10/12/2024 ENV&Iacute;AN PRESUPUESTO&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1288/398/4/R4HVTPLN6XZBMeFgY3om.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: RE_ NUEVA COMUNICACI&Oacute;N DE INVENCI&Oacute;N PARA DEPOSITO PATENTE GLOBO ESTRATOSFERICO (1).msg </a>&nbsp;</p>\r\n<p>10/12/2024 IP ENVIA NUEVA MEMORIA.&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1288/398/4/x2ATW4cKfUknOpLYqNZt.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Solicitud patente Suelta de sat&eacute;lites desde lanzador.msg </a>&nbsp;</p>\r\n<p>memoria <a href=\'../../cdn/admin/assets/solicitudes/1288/398/4/DJu3j1v4es9oQqPZRWKp.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Comunicaci&oacute;n de invenci&oacute;n Interface lanzador v0 signed JGG AGG CRS EGT JMG.pdf </a>&nbsp;</p>\r\n<p>12/12/2024 OK A PRESUPUESTO Y ENV&Iacute;O NUEVA MEMORIA DEL IP A CLARKE&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1288/398/4/2to7hXaeIPRDvSUpQ4fJ.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: RE_ NUEVA COMUNICACI&Oacute;N DE INVENCI&Oacute;N PARA DEPOSITO PATENTE GLOBO ESTRATOSFERICO (2).msg </a>&nbsp;</p>\r\n<p>16/12/2024 ip a mj_mail_no hay adjunto&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1288/398/4/vchDsbRzI7SrxelFmXAK.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Re_ Solicitud patente Suelta de sat&eacute;lites desde lanzador.msg </a>&nbsp;</p>\r\n<p>16/12/2024_clarke a mj_mail_no hay adjunto&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1288/398/4/vGumkYfIytChNl2H7WxL.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: RE_ Solicitud patente Suelta de sat&eacute;lites desde lanzador (1).msg </a>&nbsp;</p>\r\n<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/1288/398/4/f7Ytd2v4Rrpn0qDUjxOw.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: VARIO 2024_41335 N&ordm; presupuesto_ 2024_AC29878 PATENTE GLOBO ESTRATOSFERICO (1).msg </a>&nbsp;</p>\r\n<p>17/12/2024_mj a clarke, ip_mail_adjunto&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1288/398/4/nZ1oajzRYg9mp6VdWfs0.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: RE_ Solicitud patente Suelta de sat&eacute;lites desde lanzador (2).msg </a>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','2024-12-05 13:22:47'),(581,513,1,192,'12/11/2024 a xxx ASESORAMIENTOS PREVIOS','<p>12/11/2024 PRIMER CORREO <a href=\'../../cdn/admin/assets/solicitudes/1595/513/1/4ecZ8E5LOhxdIuSTp0oJ.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Propiedad Intelectual - Dudas.msg </a>&nbsp;</p>\r\n<p class=\'MsoNormal\'>Desde el grupo de investigaci&oacute;n del cual formo parte (PROMUEVE) hemos alcanzado recientemente algunos resultados de investigaci&oacute;n que creemos que podr&iacute;an ser susceptibles de proteger desde el punto de vista de la protecci&oacute;n intelectual o&nbsp;figura semejante.&nbsp;</p>\r\n<p class=\'MsoNormal\'>1. Por un lado, hemos creado un juego de mesa titulado \'Plant-a-Question\' con la idea de que estudiantes desde los &uacute;ltimos cursos de la Ed. Primaria hasta Bachillerato aprendan conceptos sobre cambio clim&aacute;tico, bot&aacute;nica o adaptaciones de las plantas al mismo tiempo que compiten y se divierten. De dicho juego, contamos con un tablero y las fichas y las preguntas correspondientes, as&iacute; como las normas del mismo. Tenemos, no obstante, las dudas siguientes:&nbsp;</p>\r\n<ul type=\'disc\'>\r\n<li class=\'MsoNormal\'>&nbsp;&iquest;Es susceptible esto de dotarse con alguna figura de propiedad intelectual o semejante? &iquest;C&oacute;mo deber&iacute;amos hacerlo?</li>\r\n<li class=\'MsoNormal\'>&iquest;Es necesario/recomendable crear una versi&oacute;n \'<em>Print&amp;Play</em>\' y ser&iacute;a esta versi&oacute;n la que proteger&iacute;amos?</li>\r\n<li class=\'MsoNormal\'>&iquest;Existe alg&uacute;n conflicto con haber divulgado o tener intenci&oacute;n de divulgar en congresos/publicaciones los resultados de aceptaci&oacute;n que hemos obtenido por parte de los jugadores?</li>\r\n</ul>\r\n<p>________________________________________________________________________</p>\r\n<p>2/12/2024 el investigador se pone nuevamente en contacto (pq no le he respondido)&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1595/513/1/MZvHX58fSQItiy6dnKa0.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Fwd_ Propiedad Intelectual - Dudas.msg </a>&nbsp;</p>\r\n<p>________________________________________________________________________</p>\r\n<p>5/12/2024 le pido al investigador una reuni&oacute;n en la OTC&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1595/513/1/EhNWFgUounz7eIQ4dC6v.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: RE_ Propiedad Intelectual - Dudas.msg </a>&nbsp;</p>\r\n<p>13/12/2024 REUNI&Oacute;N:&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1595/513/1/YrjMXe6Nq37clhtBHAkw.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 20241213_notas reunion.pdf </a>&nbsp;</p>\r\n<p>13/12/2024 mj a ip MAIL enviado&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1595/513/1/QV70HpB1A5FqaJSewORl.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Resumen de reuni&oacute;n y pr&oacute;ximos pasos para la protecci&oacute;n de un juego de mesa.msg </a>&nbsp;</p>\r\n<p class=\'MsoNormal\'>Estimados Giovanni, Aitor y Norma,</p>\r\n<p class=\'MsoNormal\'>&nbsp;</p>\r\n<p class=\'MsoNormal\'>Como hemos hablado esta ma&ntilde;ana, os env&iacute;o un resumen de los puntos tratados y los pasos necesarios para avanzar en el proceso de protecci&oacute;n de una base de datos:</p>\r\n<p class=\'MsoNormal\'><strong>&nbsp;</strong></p>\r\n<p class=\'MsoNormal\'><strong>Resumen de la reuni&oacute;n</strong></p>\r\n<ol style=\'margin-top: 0cm;\' start=\'1\' type=\'1\'>\r\n<li class=\'MsoNormal\'><strong>Protecci&oacute;n del juego de mesa</strong></li>\r\n<ul style=\'margin-top: 0cm;\' type=\'circle\'>\r\n<li class=\'MsoNormal\'>Las <strong>instrucciones del juego</strong> se proteger&aacute;n como <strong>obra cient&iacute;fica</strong> mediante propiedad intelectual.</li>\r\n<li class=\'MsoNormal\'>Los dise&ntilde;os asociados (caja, fichas, tarjetas) ser&aacute;n registrados como parte del proceso.</li>\r\n<li class=\'MsoNormal\'>La ULE emplear&aacute; tecnolog&iacute;a <strong>blockchain</strong> para realizar el dep&oacute;sito de los materiales, garantizando la trazabilidad y seguridad.</li>\r\n</ul>\r\n<li class=\'MsoNormal\'><strong>Documentaci&oacute;n a presentar</strong><br />Para iniciar el tr&aacute;mite, ser&aacute; necesario que complet&eacute;is y envi&eacute;is los siguientes formularios:</li>\r\n<ul style=\'margin-top: 0cm;\' type=\'circle\'>\r\n<li class=\'MsoNormal\'><strong>Impreso 65:</strong> Comunicaci&oacute;n de Registro de Propiedad Intelectual. Tipo de obra: OBRA CIENT&Iacute;FICA<br /><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/65_v2024_20240424.docx\' target=\'_new\'>Descargar aqu&iacute;</a>.</li>\r\n<li class=\'MsoNormal\'><strong>Impreso 65.3:</strong> Declaraci&oacute;n de autor de base de datos y otros (no programas de ordenador). (Una por cada autor) <br /><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/65_3_v230411.docx\' target=\'_new\'>Descargar aqu&iacute;</a>.</li>\r\n<li class=\'MsoNormal\' style=\'margin-bottom: 12.0pt; mso-list: l2 level2 lfo1; tab-stops: list 72.0pt;\'><strong>Impreso 65.6:</strong> Modelo de cesi&oacute;n de derechos (exclusivo para Norma, como estudiante). Adjunto</li>\r\n</ul>\r\n<li class=\'MsoNormal\'><strong>Pruebas de Concepto (POC) para Producto M&iacute;nimo Viable (PMV)</strong><br />Adem&aacute;s, hemos hablado la posibilidad de desarrollar un <strong>Producto M&iacute;nimo Viable (PMV)</strong> a trav&eacute;s de la <strong>Convocatoria ULE-POC</strong> gestionada por FGULEM, que ofrece ayudas para proyectos en dos modalidades:</li>\r\n<ul style=\'margin-top: 0cm;\' type=\'circle\'>\r\n<li class=\'MsoNormal\'><strong>POC-Investigador:</strong> Hasta <strong>5.000 &euro;</strong>.</li>\r\n<li class=\'MsoNormal\'><strong>POC-PTGAS:</strong> Hasta <strong>1.500 &euro;</strong>.</li>\r\n</ul>\r\n</ol>\r\n<p class=\'MsoNormal\' style=\'margin-left: 72.0pt;\'>&nbsp;</p>\r\n<p class=\'MsoNormal\'><strong>Plazos clave:</strong></p>\r\n<ul style=\'margin-top: 0cm;\' type=\'disc\'>\r\n<li class=\'MsoNormal\'>Presentaci&oacute;n de solicitudes: <strong>Hasta el 19 de enero de 2025.</strong></li>\r\n<li class=\'MsoNormal\'>Desarrollo de los proyectos: <strong>Hasta el 31 de agosto de 2025.</strong></li>\r\n</ul>\r\n<p class=\'MsoNormal\'>Pod&eacute;is consultar las bases y anexos de la convocatoria <span class=\'MsoHyperlink\'>aqu&iacute;</span>. Para m&aacute;s informaci&oacute;n, pod&eacute;is contactar con la OTC de FGULEM en <a href=\'mailto:otc@fgulem.es\'>otc@fgulem.es</a> o en el tel&eacute;fono <strong>987 29 16 51</strong>.</p>\r\n<p class=\'MsoNormal\'>&nbsp;<strong>Pr&oacute;ximos pasos</strong></p>\r\n<ol style=\'margin-top: 0cm;\' start=\'1\' type=\'1\'>\r\n<li class=\'MsoNormal\'>Completar los formularios necesarios seg&uacute;n lo indicado.</li>\r\n<li class=\'MsoNormal\'>Preparar los materiales para el registro (instrucciones y dise&ntilde;os).</li>\r\n<li class=\'MsoNormal\'>Si os interesa, valorar la preparaci&oacute;n de una solicitud para la convocatoria ULE-POC.</li>\r\n</ol>\r\n<p class=\'MsoNormal\'>&nbsp;Cualquier duda o aclaraci&oacute;n durante este proceso, os poneis en contacto con la OTC.</p>\r\n<p class=\'MsoNormal\'>&nbsp;Una vez que tengamos el formulario completo, podremos avanzar con las siguientes fases del procedimiento.</p>\r\n<p class=\'MsoNormal\'>&nbsp;</p>\r\n<p class=\'MsoNormal\'>Saludos,&nbsp;</p>\r\n<p>________________________________________________________________________</p>\r\n<p>PTE RESPUESTA</p>\r\n<p class=\'MsoNormal\'>&nbsp;</p>\r\n<p>&nbsp;</p>','2024-12-05 13:39:20'),(582,113,46,NULL,'FACTUACIÓN (SANTIAGO GALÉ) - BOLSA DE HORAS','<p>pte que llegue en FACE.&nbsp;</p>\r\n<p>16/12/2024. env&iacute;o mail a EVA (SGI) para que me mire por qu&eacute; no llega la factura.&nbsp;</p>\r\n<p><span style=\'background-color: #fbeeb8;\'>PTE REVISAR ESTA FACTURA Y PAGO FACE</span></p>','2024-12-12 09:19:16'),(583,125,24,NULL,'12/12/2024 OK EN PORTAFIRMAS -  pagado','<p>11/12/2024 llega portafirmas&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/24/125/24/bYeo52SlukTVj3EJ4gdp.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Portafirmas - Petici&oacute;n recibida - CONF-2024_000000019156-1812EUROS-PREPARACI&Oacute;N Y PRESENTACI&Oacute;N DE LA RESPUESTA A LA OPINI&Oacute;N ESCRI.msg </a>&nbsp;</p>\r\n<p>17/10/2024 fra FACE21924/2024&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/24/125/24/dMPp8YOt4Z3zciFjWBfD.PDF\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 241017_Fra FACE 21924.2024.PDF </a>&nbsp;</p>','2024-12-12 12:34:37'),(584,515,1,NULL,'12/11/2024 a xxx mails','<p>12/11/2024 ip a mjb:&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1595/515/1/FeOnD6yK2Y9f1XJQETbG.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Propiedad Intelectual - Dudas.msg </a>&nbsp;</p>\r\n<p class=\'MsoNormal\'>Buenos d&iacute;as,</p>\r\n<p class=\'MsoNormal\'>&nbsp;</p>\r\n<p class=\'MsoNormal\'>Desde el grupo de investigaci&oacute;n del cual formo parte (PROMUEVE) hemos alcanzado recientemente algunos resultados de investigaci&oacute;n que creemos que podr&iacute;an ser susceptibles de proteger desde el punto de vista de la protecci&oacute;n intelectual o&nbsp;figura semejante.&nbsp;</p>\r\n<p class=\'MsoNormal\'>&nbsp;</p>\r\n<p class=\'MsoNormal\'>1. Por un lado, hemos creado un juego de mesa titulado \'Plant-a-Question\' con la idea de que estudiantes desde los &uacute;ltimos cursos de la Ed. Primaria hasta Bachillerato aprendan conceptos sobre cambio clim&aacute;tico, bot&aacute;nica o adaptaciones de las plantas al mismo tiempo que compiten y se divierten. De dicho juego, contamos con un tablero y las fichas y las preguntas correspondientes, as&iacute; como las normas del mismo. Tenemos, no obstante, las dudas siguientes:&nbsp;</p>\r\n<ul type=\'disc\'>\r\n<li class=\'MsoNormal\'>&nbsp;&iquest;Es susceptible esto de dotarse con alguna figura de propiedad intelectual o semejante? &iquest;C&oacute;mo deber&iacute;amos hacerlo?</li>\r\n<li class=\'MsoNormal\'>&iquest;Es necesario/recomendable crear una versi&oacute;n \'<em>Print&amp;Play</em>\' y ser&iacute;a esta versi&oacute;n la que proteger&iacute;amos?</li>\r\n<li class=\'MsoNormal\'>&iquest;Existe alg&uacute;n conflicto con haber divulgado o tener intenci&oacute;n de divulgar en congresos/publicaciones los resultados de aceptaci&oacute;n que hemos obtenido por parte de los jugadores?</li>\r\n</ul>\r\n<p class=\'MsoNormal\'>2. Por otro lado, como parte de mi propio proyecto de tesis, hemos generado una base de datos clim&aacute;ticos para la regi&oacute;n mediterr&aacute;nea europea que,&nbsp;creo, en base a la normativa y observando el modelo 66, podr&iacute;a dotarse tambi&eacute;n de una figura de propiedad intelectual. Aun as&iacute;, tenemos varias dudas al respecto:&nbsp;</p>\r\n<ul type=\'disc\'>\r\n<li class=\'MsoNormal\'>Sobre el impreso 66: no comprendo qu&eacute; debe a&ntilde;adirse en el % Reparto de beneficios (considerando que nos acogi&eacute;ramos a la modalidad a).&nbsp;</li>\r\n<li class=\'MsoNormal\'>&iquest;Es necesario que est&eacute; alojada en alg&uacute;n servidor p&uacute;blico antes de remitir la solicitud? En ese caso, &iquest;c&oacute;mo se puede incluir en la web <a href=\'http://data.europa.eu\'>data.europa.eu</a> que citan en el impreso 66?&iquest;sirven directorios generales del tipo <em>ZENODO</em>?</li>\r\n<li class=\'MsoNormal\'>&iquest;Es incompatible este proceso con, si se diera el caso, posteriormente realizar una publicaci&oacute;n cient&iacute;fica describiendo la base de datos?</li>\r\n</ul>\r\n<p class=\'MsoNormal\'>&nbsp;</p>\r\n<p class=\'MsoNormal\'>Les agradecemos de antemano su atenci&oacute;n.</p>\r\n<p class=\'MsoNormal\'>&nbsp;</p>\r\n<p class=\'MsoNormal\'>Reciban un cordial saludo,</p>\r\n<p>&nbsp;</p>\r\n<p class=\'MsoNormal\'>Giovanni.&nbsp;</p>\r\n<p class=\'MsoNormal\'>2/12/2024 ip a mjb (reenv&iacute;a mail anterior)&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1595/515/1/7rQZ5TVR0CSDkyh9mf8e.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Fwd_ Propiedad Intelectual - Dudas.msg </a>&nbsp;</p>\r\n<p class=\'MsoNormal\'>&nbsp;</p>\r\n<p class=\'MsoNormal\'>5/12/2024 mjb a ip:&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1595/515/1/aYpcMsSq6d4AnNIPHROU.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: RE_ Propiedad Intelectual - Dudas.msg </a>&nbsp;</p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>Hola&iexcl; </span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>Genial&iexcl; </span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>Desde la OTC os echamos una mano. Pero, &iquest;podemos tener una reuni&oacute;n para aclarar todo?.</span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>Estamos en pabell&oacute;n de gobierno. </span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>&iquest;Cuando os viene bien acercaros?</span></p>\r\n<p class=\'MsoNormal\'>&nbsp;</p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>Saludos,&nbsp;</span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>11/12/2024: IP A MJB:&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1595/515/1/aywFZmL0uUYgWH3SJjns.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Re_ Propiedad Intelectual - Dudas (1).msg </a>&nbsp;</span></p>\r\n<p class=\'MsoNormal\'>Hola Mar&iacute;a Jos&eacute;,</p>\r\n<p class=\'MsoNormal\'>&nbsp;Nosotros podr&iacute;amos ma&ntilde;ana o el viernes, a poder ser a primera&nbsp;hora de la ma&ntilde;ana.</p>\r\n<p class=\'MsoNormal\'>&nbsp;Gracias por la amabilidad y un saludo,</p>\r\n<p class=\'MsoNormal\'>Giovanni.&nbsp;</p>\r\n<p class=\'MsoNormal\'>12/12/2024 MJB A IP&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1595/515/1/ShuoO6t9k3cZDKrdTzNs.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: RE_ Propiedad Intelectual - Dudas (2).msg </a>&nbsp;</p>\r\n<p class=\'MsoNormal\'>&nbsp;</p>\r\n<p class=\'MsoNormal\'>&nbsp;<span style=\'font-size: 11pt;\'>Hola,</span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>Perdonar, me tuve que ausentar un par de d&iacute;as de la oficina por asuntos particulares. </span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>Si, ma&ntilde;ana a primera hora, tengo posibilidad de reuni&oacute;n. </span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>Estoy en el edificio OTC en los jardines del alb&eacute;itar. </span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>Pongo una reuni&oacute;n en el calendar a las 9.00</span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>Saludos, </span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-language: EN-US;\'>MJ</span></p>\r\n<p class=\'MsoNormal\'><span style=\'font-size: 11.0pt; mso-fareast-lang