ct: text; -webkit-user-drag: none; -webkit-tap-highlight-color: transparent; white-space: pre !important;\' /></span></span></p>\r\n<p>&nbsp;</p>','2024-12-12 13:05:58'),(587,515,1,207,'10/12/2024 a xxx ASESORAMIENTOS PREVIS','<p>10/12/52024 ip primera llamada</p>\r\n<p>13/12/2024 reunion&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1595/515/1/ympBsVXElq9D0Ig1GuZ6.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: 20241213_notas reunion.pdf </a>&nbsp;</p>\r\n<p>13/12/2024 envio mail.&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/1595/515/1/Lp29lne3bgd4tJfoTGsy.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: Resumen de nuestra reuni&oacute;n y pasos a seguir para la protecci&oacute;n de bases de datos.msg </a>&nbsp;</p>\r\n<p class=\'MsoNormal\'>Estimados Giovanni, Aitor y Norma,</p>\r\n<p class=\'MsoNormal\'>&nbsp;</p>\r\n<p class=\'MsoNormal\'>Como hemos hablado esta ma&ntilde;ana, os env&iacute;o un resumen de los puntos tratados y los pasos necesarios para avanzar en el proceso de protecci&oacute;n de una base de datos:</p>\r\n<p class=\'MsoNormal\'><strong>&nbsp;</strong></p>\r\n<p class=\'MsoNormal\'><strong>Resumen de la reuni&oacute;n</strong></p>\r\n<p class=\'MsoNormal\'><strong>Bases de datos como resultado de la actividad investigadora</strong><br />Hemos visto que las bases de datos, como resultado de su actividad investigadora, pueden protegerse mediante&nbsp;<strong>propiedad intelectual</strong>. Para ello, se contemplan dos tipos de registros a trav&eacute;s de la Oficina de Transferencia de Conocimiento (OTC):</p>\r\n<ol style=\'margin-top: 0cm;\' start=\'1\' type=\'1\'>\r\n<li class=\'MsoNormal\'><strong>Base de datos</strong>: Protege la estructura vac&iacute;a y las relaciones dentro de la base de datos.</li>\r\n<li class=\'MsoNormal\'><strong>Conjunto de datos o dataset</strong>: Protege el contenido o paquete de datos.</li>\r\n</ol>\r\n<p class=\'MsoNormal\'>Cada formulario es independiente y debe completarse de forma diferenciada.</p>\r\n<p class=\'MsoNormal\'><strong>Procedimiento en la OTC</strong><br />El procedimiento que se seguir&aacute; incluye los siguientes pasos:</p>\r\n<ol style=\'margin-top: 0cm;\' start=\'1\' type=\'1\'>\r\n<li class=\'MsoNormal\'>Comunicaci&oacute;n del resultado mediante los formularios correspondientes.</li>\r\n<li class=\'MsoNormal\'>Revisi&oacute;n y autorizaci&oacute;n por parte de la Comisi&oacute;n de Investigaci&oacute;n.</li>\r\n<li class=\'MsoNormal\'>Registro formal y certificaci&oacute;n del m&eacute;rito asociado al proyecto.&nbsp;</li>\r\n</ol>\r\n<p class=\'MsoNormal\'>Posteriormente, podr&iacute;an contactar con la compa&ntilde;era del &aacute;rea de&nbsp;<strong>Promoci&oacute;n</strong>&nbsp;para avanzar en las opciones de licencia de explotaci&oacute;n o de uso.</p>\r\n<p class=\'MsoNormal\'><strong>Particularidad para Norma</strong><br />Dado que Norma es estudiante, ser&aacute; necesario que firme la&nbsp;<strong>cesi&oacute;n de derechos de explotaci&oacute;n</strong>&nbsp;de acuerdo con el art&iacute;culo 97.4 del Texto Refundido de la Ley de Propiedad Intelectual (TRLPI).</p>\r\n<p class=\'MsoNormal\'><strong>&nbsp;</strong></p>\r\n<p class=\'MsoNormal\'><strong>&nbsp;</strong></p>\r\n<p class=\'MsoNormal\'><strong>Pasos a seguir</strong></p>\r\n<ol style=\'margin-top: 0cm;\' start=\'1\' type=\'1\'>\r\n<li class=\'MsoNormal\'><strong>Completar los formularios de comunicaci&oacute;n</strong>:</li>\r\n<ul style=\'margin-top: 0cm;\' type=\'circle\'>\r\n<li class=\'MsoNormal\'><strong>Comunicaci&oacute;n para la base de datos</strong>: Formulario 65 &ndash; Comunicaci&oacute;n de Registro de Propiedad Intelectual.&nbsp;<a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/65_v2024_20240424.docx\' target=\'_new\'>Descargar&nbsp;aqu&iacute;</a>.</li>\r\n<li class=\'MsoNormal\'><strong>Comunicaci&oacute;n para el conjunto de datos o dataset</strong>: Formulario 66 &ndash; Comunicaci&oacute;n de Registro de Propiedad Intelectual &ndash; Paquete de Datos o &ldquo;Datasets&rdquo;.&nbsp;<a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/66_v01_OC_DATASETS_20231019.docx\' target=\'_new\'>Descargar&nbsp;aqu&iacute;</a>.</li>\r\n</ul>\r\n<li class=\'MsoNormal\'><strong>Declaraci&oacute;n de autor y cesi&oacute;n de derechos para Norma</strong>: Formulario 65.6 Cesi&oacute;n. Adjunto.</li>\r\n<li class=\'MsoNormal\'>Justificar en las comunicaciones la relevancia y trayectoria de la investigaci&oacute;n que ha dado lugar a estos resultados.</li>\r\n<li class=\'MsoNormal\'>Enviar los formularios completos a la OTC para su evaluaci&oacute;n y tramitaci&oacute;n.</li>\r\n</ol>\r\n<p class=\'MsoNormal\'>&nbsp;</p>\r\n<p class=\'MsoNormal\'>&nbsp;</p>\r\n<p class=\'MsoNormal\'>Cualquier duda o aclaraci&oacute;n durante este proceso, os poneis en contacto con la OTC. Una vez que tengamos los formularios completos, podremos avanzar con las siguientes fases del procedimiento.</p>\r\n<p>&nbsp;</p>\r\n<p class=\'MsoNormal\'>Saludos,&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>PTE RESPUESTA</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','2024-12-13 08:56:24'),(589,185,48,NULL,'15/11/2024 CERTIFICADO MATRIZ ASIENTO REGISTRAL 2024 - 000005','<p>&nbsp;<a href=\'../../cdn/admin/assets/solicitudes/24/185/48/s7R8XLSHdWvw4FJj0p2h.pdf\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: CERTIFICADO MATRIZ 2024.000005.report.pdf </a>&nbsp;</p>\r\n<p>13/12/2024 mjb a ip ENVIO ASIENTO REGISTRAL <a href=\'../../cdn/admin/assets/solicitudes/24/185/48/0Gxl5oIF3PTKitDRepEy.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: ENVIO ASIENTO REGISTRAL .msg </a>&nbsp;</p>\r\n<p>13/12/2024 mjb a fgulem ENVIO ASIENTO REGISTRAL&nbsp; <a href=\'../../cdn/admin/assets/solicitudes/24/185/48/0NQeGWTm3O7pAhbRH1dI.msg\' target=\'_blank\' rel=\'noopener\'>Enlace al documento: RE_ ENVIO ASIENTO REGISTRAL .msg </a>&nbsp;</p>','2024-12-13 14:50:52'),(591,185,48,180,'','','2024-12-13 