 Calibri, sans-serif; line-height: 20.7px;\' xml:lang=\'ES\' data-contrast=\'auto\'>&nbsp;</span><span class=\'EOP SCXO153306779 BCX9\' style=\'margin: 0px; padding: 0px; user-select: text; -webkit-user-drag: none; -webkit-tap-highlight-color: transparent; font-size: 11pt; line-height: 20.7px; font-family: Calibri, sans-serif; color: windowtext;\'>&nbsp;</span></p>\r\n</div>\r\n<div class=\'OutlineElement Ltr SCXO153306779 BCX9\' style=\'margin: 0px; padding: 0px; user-select: text; -webkit-user-drag: none; -webkit-tap-highlight-color: transparent; overflow: visible; cursor: text; clear: both; position: relative; direction: ltr; font-family: \'Segoe UI\', \'Segoe UI Web\', Arial, Verdana, sans-serif; font-size: 12px; background-color: #ffffff;\'>\r\n<p class=\'Paragraph SCXO153306779 BCX9\' lang=\'ES-ES\' style=\'margin: 0px; padding: 0px; user-select: text; -webkit-user-drag: none; -webkit-tap-highlight-color: transparent; overflow-wrap: break-word; vertical-align: baseline; font-kerning: none; background-color: transparent; color: windowtext;\' xml:lang=\'ES-ES\'><span class=\'TextRun SCXO153306779 BCX9\' lang=\'ES-ES\' style=\'margin: 0px; padding: 0px; user-select: text; -webkit-user-drag: none; -webkit-tap-highlight-color: transparent; font-variant-ligatures: none !important; color: windowtext; font-size: 11pt; font-family: Calibri, sans-serif; line-height: 20.7px;\' xml:lang=\'ES-ES\' data-contrast=\'auto\'>Saludos,&nbsp;</span><span class=\'EOP SCXO153306779 BCX9\' style=\'margin: 0px; padding: 0px; user-select: text; -webkit-user-drag: none; -webkit-tap-highlight-color: transparent; font-size: 11pt; line-height: 20.7px; font-family: Calibri, sans-serif; color: windowtext;\'>&nbsp;</span></p>\r\n</div>','2024-11-29 11:47:41',0),(205,20,NULL,'MAIL RESUMEN PRIMERA REUNION','<p><strong>Asunto:</strong> Resumen de nuestra reuni&oacute;n y enlaces a los formularios necesarios</p>\r\n<p>Estimado Iv&aacute;n,</p>\r\n<p>Tal como hemos comentado esta ma&ntilde;ana, env&iacute;o un resumen de nuestra reuni&oacute;n, junto con los enlaces a los formularios necesarios para realizar la <strong>comunicaci&oacute;n de invenci&oacute;n</strong> (en este caso, de patente).</p>\r\n<p>Como resumen de lo comentado, hago un repaso:</p>\r\n<h3>1. V&iacute;as de protecci&oacute;n</h3>\r\n<p>Hemos planteado las distintas v&iacute;as de protecci&oacute;n por propiedad intelectual e industrial:</p>\r\n<ul>\r\n<li><strong>Industrial</strong>:\r\n<ul>\r\n<li>Patentes</li>\r\n<li>Modelos de utilidad</li>\r\n<li>Dise&ntilde;os</li>\r\n<li>Marcas</li>\r\n<li>...</li>\r\n</ul>\r\n</li>\r\n<li><strong>Intelectual</strong>:\r\n<ul>\r\n<li>Software</li>\r\n<li>Bases de datos</li>\r\n<li>Conjuntos de datos</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>Tambi&eacute;n hemos hablado del <strong>secreto empresarial</strong> como alternativa cuando la explotaci&oacute;n lo requiera.</p>\r\n<h3>2. Alumnos y vinculaci&oacute;n laboral</h3>\r\n<p>En relaci&oacute;n con la autor&iacute;a, hemos comentado que, si la invenci&oacute;n es el resultado de una <strong>tesis</strong> en la que los tutores han tenido una participaci&oacute;n activa, deber&aacute; justificarse este hecho en la comunicaci&oacute;n de invenci&oacute;n, reflejando los porcentajes de autor&iacute;a de cada participante.</p>\r\n<ul>\r\n<li>En el caso de las <strong>tesis doctorales</strong>, los alumnos con vinculaci&oacute;n laboral con la ULE no necesitan firmar ning&uacute;n documento adicional.</li>\r\n<li>Si no tienen vinculaci&oacute;n laboral, es necesario que firmen el documento <strong>&ldquo;47.2 Cesi&oacute;n de Derechos de Propiedad Industrial&rdquo;</strong>, o que se justifique una cotitularidad de la invenci&oacute;n. Este &uacute;ltimo caso debe reflejarse en el formulario de cotitularidad indicando los porcentajes correspondientes.</li>\r\n</ul>\r\n<p>Puedes descargar los formularios en los siguientes enlaces:</p>\r\n<ul>\r\n<li><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/47_2_20230829.docx\' target=\'_new\' rel=\'noopener\'>47.2 Cesi&oacute;n de Derechos de Propiedad Industrial</a></li>\r\n<li><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/47_1_v20201_20210416.docx\' target=\'_new\' rel=\'noopener\'>47.1 Acuerdo de Cotitularidad</a></li>\r\n</ul>\r\n<h3>Confidencialidad en tesis doctorales</h3>\r\n<p>En el caso de <strong>tesis doctorales</strong>, est&aacute;n disponibles los siguientes <strong>impresos de confidencialidad</strong>:</p>\r\n<ul>\r\n<li><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/confidencialidad_tesis_20230908.doc\' target=\'_new\' rel=\'noopener\'>32 Solicitud de confidencialidad en la defensa de la tesis</a></li>\r\n<li><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/confidencialidad_tribunal20200117.doc\' target=\'_new\' rel=\'noopener\'>Compromiso de confidencialidad del tribunal de defensa de la tesis</a></li>\r\n</ul>\r\n<h3>3. Procedimiento de protecci&oacute;n</h3>\r\n<p>Hemos repasado el procedimiento, que comienza con la <strong>comunicaci&oacute;n de invenci&oacute;n</strong>. Aunque tomamos como referencia una patente, este proceso aplica a cualquier modalidad de protecci&oacute;n. En el caso de patente, el formulario es el <strong>47 Comunicaci&oacute;n de Invenciones</strong>, que puedes descargar aqu&iacute;:</p>\r\n<ul>\r\n<li><a target=\'_new\' rel=\'noopener\'>47 Comunicaci&oacute;n de Invenciones</a></li>\r\n</ul>\r\n<h3>4. Costes de la patente</h3>\r\n<p>Hemos hablado tambi&eacute;n de los costes asociados a una patente:</p>\r\n<ul>\r\n<li><strong>Solicitud inicial</strong>: entre 2.000 y 3.000 euros.</li>\r\n<li><strong>Extensi&oacute;n internacional (PCT)</strong> en el mes 12: alrededor de 6.000 euros.</li>\r\n<li><strong>Decisi&oacute;n de pa&iacute;ses</strong> en el mes 32: costes variables dependiendo de los pa&iacute;ses seleccionados.</li>\r\n</ul>\r\n<p>Ser&aacute; necesario indicar en la comunicaci&oacute;n de invenci&oacute;n qui&eacute;n asumir&aacute; los gastos correspondientes seg&uacute;n el <strong>Reglamento de Contratos vigente</strong> (art&iacute;culo 8.13), que puedes consultar aqu&iacute;:</p>\r\n<ul>\r\n<li><a href=\'https://www.unileon.es/modelos/archivo/norregint/20060107131126Contratos,conveniosyproyectosdeinvestigacion.Reglamento.doc\' target=\'_new\' rel=\'noopener\'>Reglamento de Contratos</a></li>\r\n</ul>\r\n<h3>5. Otras formas de protecci&oacute;n</h3>\r\n<p>Tambi&eacute;n comentamos que existen otras opciones de protecci&oacute;n por v&iacute;a de <strong>propiedad intelectual</strong> (software, bases de datos, conjuntos de datos). Para estas modalidades, el formulario a utilizar es el <strong>65 Comunicaci&oacute;n de Registro de Propiedad Intelectual</strong>, acompa&ntilde;ado de la documentaci&oacute;n de los autores, que enviar&eacute; cuando se inicie el proceso.</p>\r\n<p>Puedes descargar el formulario aqu&iacute;:</p>\r\n<ul>\r\n<li><a target=\'_new\' rel=\'noopener\'>65 Comunicaci&oacute;n de Registro de Propiedad Intelectual</a></li>\r\n</ul>\r\n<h3>6. Promoci&oacute;n y transferencia</h3>\r\n<p>En la <strong>OTC</strong> contamos con un &aacute;rea de <strong>promoci&oacute;n</strong>, que realiza actuaciones dirigidas a la <strong>transferencia efectiva de los resultados</strong>. Adem&aacute;s, desde la <strong>FGULEM</strong> se llevan a cabo acciones dentro del <strong>PATCO (Plan de Apoyo a la Transferencia del Conocimiento)</strong>, como las convocatorias de <strong>Pruebas de Concepto (POC)</strong>, que pueden ser de inter&eacute;s.</p>\r\n<p>Puedes encontrar m&aacute;s informaci&oacute;n sobre el PATCO aqu&iacute;:</p>\r\n<ul>\r\n<li><a href=\'https://fgulem.unileon.es/patco/\' target=\'_new\' rel=\'noopener\'>PATCO - Plan de Apoyo a la Transferencia del Conocimiento</a></li>\r\n</ul>\r\n<p>Actualmente estamos preparando la versi&oacute;n del pr&oacute;ximo a&ntilde;o, pero este enlace te permitir&aacute; hacerte una idea de todo lo que se ofrece.</p>\r\n<p>En caso de que se decida que la <strong>v&iacute;a de explotaci&oacute;n</strong> sea la creaci&oacute;n de una <strong>Empresa Basada en el Conocimiento (EBC)</strong>, la ULE dispone de toda la normativa e impresos necesarios para facilitar el proceso. Es importante se&ntilde;alar que estas empresas deben contar con un profesor de la ULE implicado para ser consideradas EBC.</p>\r\n<h3>7. Preservaci&oacute;n de la novedad</h3>\r\n<p>Finalmente, reiteramos la importancia de <strong>preservar la novedad de la invenci&oacute;n</strong> durante todo el proceso, evitando cualquier divulgaci&oacute;n que pueda comprometer su protecci&oacute;n.</p>\r\n<p>Quedo a tu disposici&oacute;n para resolver cualquier duda que pueda surgir durante el proceso de cumplimentaci&oacute;n de estos documentos o sobre cualquier otro aspecto relacionado con la protecci&oacute;n.</p>\r\n<p>Quedo a la espera de tus noticias.</p>\r\n<p>Recibe un cordial saludo,<br />[Tu Nombre]<br />[Tu Cargo]<br />[Tu Organizaci&oacute;n]<br />[Datos de contacto, si aplican]</p>','2024-12-04 12:56:45',0),(207,70,NULL,'13/12/2024_mj a ip_mail resumen reunión y pasos a seguir para la protección de bases de datos','<p class=\'MsoNormal\'>Estimados Giovanni, Aitor y Norma,</p>\r\n<p class=\'MsoNormal\'>&nbsp;</p>\r\n<p class=\'MsoNormal\'>Como hemos hablado esta ma&ntilde;ana, os env&iacute;o un resumen de los puntos tratados y los pasos necesarios para avanzar en el proceso de protecci&oacute;n de una base de datos:</p>\r\n<p class=\'MsoNormal\'><strong>&nbsp;</strong></p>\r\n<p class=\'MsoNormal\'><strong>Resumen de la reuni&oacute;n</strong></p>\r\n<p class=\'MsoNormal\'><strong>Bases de datos como resultado de la actividad investigadora</strong><br />Hemos visto que las bases de datos, como resultado de su actividad investigadora, pueden protegerse mediante&nbsp;<strong>propiedad intelectual</strong>. Para ello, se contemplan dos tipos de registros a trav&eacute;s de la Oficina de Transferencia de Conocimiento (OTC):</p>\r\n<ol start=\'1\' type=\'1\'>\r\n<li class=\'MsoNormal\'><strong>Base de datos</strong>: Protege la estructura vac&iacute;a y las relaciones dentro de la base de datos.</li>\r\n<li class=\'MsoNormal\'><strong>Conjunto de datos o dataset</strong>: Protege el contenido o paquete de datos.</li>\r\n</ol>\r\n<p class=\'MsoNormal\'>Cada formulario es independiente y debe completarse de forma diferenciada.</p>\r\n<p class=\'MsoNormal\'><strong>Procedimiento en la OTC</strong><br />El procedimiento que se seguir&aacute; incluye los siguientes pasos:</p>\r\n<ol start=\'1\' type=\'1\'>\r\n<li class=\'MsoNormal\'>Comunicaci&oacute;n del resultado mediante los formularios correspondientes.</li>\r\n<li class=\'MsoNormal\'>Revisi&oacute;n y autorizaci&oacute;n por parte de la Comisi&oacute;n de Investigaci&oacute;n.</li>\r\n<li class=\'MsoNormal\'>Registro formal y certificaci&oacute;n del m&eacute;rito asociado al proyecto.&nbsp;</li>\r\n</ol>\r\n<p class=\'MsoNormal\'>Posteriormente, podr&iacute;an contactar con la compa&ntilde;era del &aacute;rea de&nbsp;<strong>Promoci&oacute;n</strong>&nbsp;para avanzar en las opciones de licencia de explotaci&oacute;n o de uso.</p>\r\n<p class=\'MsoNormal\'><strong>Particularidad para Norma</strong><br />Dado que Norma es estudiante, ser&aacute; necesario que firme la&nbsp;<strong>cesi&oacute;n de derechos de explotaci&oacute;n</strong>&nbsp;de acuerdo con el art&iacute;culo 97.4 del Texto Refundido de la Ley de Propiedad Intelectual (TRLPI).</p>\r\n<p class=\'MsoNormal\'><strong>&nbsp;</strong></p>\r\n<p class=\'MsoNormal\'><strong>&nbsp;</strong></p>\r\n<p class=\'MsoNormal\'><strong>Pasos a seguir</strong></p>\r\n<ol start=\'1\' type=\'1\'>\r\n<li class=\'MsoNormal\'><strong>Completar los formularios de comunicaci&oacute;n</strong>:</li>\r\n<ul type=\'circle\'>\r\n<li class=\'MsoNormal\'><strong>Comunicaci&oacute;n para la base de datos</strong>: Formulario 65 &ndash; Comunicaci&oacute;n de Registro de Propiedad Intelectual.&nbsp;<a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/65_v2024_20240424.docx\' target=\'_blank\' rel=\'noopener\'>Descargar&nbsp;aqu&iacute;</a>.</li>\r\n<li class=\'MsoNormal\'><strong>Comunicaci&oacute;n para el conjunto de datos o dataset</strong>: Formulario 66 &ndash; Comunicaci&oacute;n de Registro de Propiedad Intelectual &ndash; Paquete de Datos o &ldquo;Datasets&rdquo;.&nbsp;<a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/66_v01_OC_DATASETS_20231019.docx\' target=\'_blank\' rel=\'noopener\'>Descargar&nbsp;aqu&iacute;</a>.</li>\r\n</ul>\r\n<li class=\'MsoNormal\'><strong>Declaraci&oacute;n de autor y cesi&oacute;n de derechos para Norma</strong>: Formulario 65.6 Cesi&oacute;n. Adjunto.</li>\r\n<li class=\'MsoNormal\'>Justificar en las comunicaciones la relevancia y trayectoria de la investigaci&oacute;n que ha dado lugar a estos resultados.</li>\r\n<li class=\'MsoNormal\'>Enviar los formularios completos a la OTC para su evaluaci&oacute;n y tramitaci&oacute;n.</li>\r\n</ol>\r\n<p class=\'MsoNormal\'>&nbsp;</p>\r\n<p class=\'MsoNormal\'>&nbsp;</p>\r\n<p class=\'MsoNormal\'>Cualquier duda o aclaraci&oacute;n durante este proceso, os poneis en contacto con la OTC. Una vez que tengamos los formularios completos, podremos avanzar con las siguientes fases del procedimiento.</p>\r\n<p>&nbsp;</p>\r\n<p class=\'MsoNormal\'>Saludos,&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','2024-12-05 10:16:02',0),(208,7,NULL,'Fecha PUBLICACIÓN','<p>N&ordm; SOLICITUD</p>','2024-12-05 12:05:14',0),(209,7,NULL,'Fecha (2 meses despues de la publicación) FIN PLAZO OPOSICIONES - CONCESIÓN','<p>N&ordm; CONCESI&Oacute;N</p>','2024-12-05 12:05:59',0),(210,193,NULL,'hito de prueba','','2024-12-10 12:31:17',0),(211,107,NULL,'decision si oepm o euipo','<p>Mails decision</p>\r\n<p>hafolea &ntilde;ik&nbsp; kla li a</p>\r\n<p>&ntilde;l ask h&ntilde;oie lka&ntilde;le ka &ntilde;kle &ntilde;l as kdlkjwejjkldlk&nbsp;<br />s&ntilde;l&ntilde;kjf &ntilde;ilea&ntilde;lk</p>\r\n<p>sfdlka&ntilde;lsihije</p>\r\n<p>&ntilde;falssije&ntilde;oijkljj</p>\r\n<p>&ntilde;fkae&ntilde;kjmdki</p>','2024-12-12 09:59:53',0),(212,71,NULL,'PLANTILLA MAIL 1ª REUNION','<h3><strong style=\'font-size: 16px;\'>Asunto:</strong><span style=\'font-size: 16px;\'> Resumen de reuni&oacute;n y pr&oacute;ximos pasos para la protecci&oacute;n y desarrollo del proyecto</span></h3>\r\n<p>Estimados [Nombres de los investigadores],</p>\r\n<p>Tras la reuni&oacute;n mantenida, os detallo los puntos principales tratados y los pr&oacute;ximos pasos necesarios para avanzar en la protecci&oacute;n y desarrollo del juego de mesa:</p>\r\n<h3><strong>Resumen de la reuni&oacute;n</strong></h3>\r\n<ol>\r\n<li>\r\n<p><strong>Protecci&oacute;n del juego de mesa</strong></p>\r\n<ul>\r\n<li>Las <strong>instrucciones del juego</strong> se proteger&aacute;n como <strong>obra cient&iacute;fica</strong> mediante propiedad intelectual.</li>\r\n<li>Los dise&ntilde;os asociados (caja, fichas, tarjetas) ser&aacute;n registrados como parte del proceso.</li>\r\n<li>La ULE emplear&aacute; tecnolog&iacute;a <strong>blockchain</strong> para realizar el dep&oacute;sito de los materiales, garantizando la trazabilidad y seguridad.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p><strong>Documentaci&oacute;n a presentar</strong><br />Para iniciar el tr&aacute;mite, ser&aacute; necesario que complet&eacute;is y envi&eacute;is los siguientes formularios:</p>\r\n<ul>\r\n<li><strong>Impreso 65:</strong> Comunicaci&oacute;n de Registro de Propiedad Intelectual.<br /><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/65_v2024_20240424.docx\' target=\'_new\' rel=\'noopener\'>Descargar aqu&iacute;</a>.</li>\r\n<li><strong>Impreso 65.3:</strong> Declaraci&oacute;n de autor de base de datos y otros (no programas de ordenador).<br /><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/65_3_v230411.docx\' target=\'_new\' rel=\'noopener\'>Descargar aqu&iacute;</a>.</li>\r\n<li><strong>Impreso 65.6:</strong> Modelo de cesi&oacute;n de derechos (exclusivo para Norma, como estudiante).<br /><a href=\'https://www.unileon.es/ficheros/investigacion/impresos/nuevos/65_6_v230411.docx\' target=\'_new\' rel=\'noopener\'>Descargar aqu&iacute;</a>.</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p><strong>Pruebas de Concepto (POC) para Producto M&iacute;nimo Viable (PMV)</strong><br />Adem&aacute;s, hemos discutido la posibilidad de desarrollar un <strong>Producto M&iacute;nimo Viable (PMV)</strong> a trav&eacute;s de la <strong>Convocatoria ULE-POC</strong> gestionada por FGULEM, que ofrece ayudas para proyectos en dos modalidades:</p>\r\n<ul>\r\n<li><strong>POC-Investigador:</strong> Hasta <strong>5.000 &euro;</strong>.</li>\r\n<li><strong>POC-PTGAS:</strong> Hasta <strong>1.500 &euro;</strong>.</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p><strong>Plazos clave:</strong></p>\r\n<ul>\r\n<li>Presentaci&oacute;n de solicitudes: <strong>Hasta el 19 de enero de 2025.</strong></li>\r\n<li>Desarrollo de los proyectos: <strong>Hasta el 31 de agosto de 2025.</strong></li>\r\n</ul>\r\n<p>Pod&eacute;is consultar las bases y anexos de la convocatoria <a href=\'#\' rel=\'noopener\'>aqu&iacute;</a>. Para m&aacute;s informaci&oacute;n, pod&eacute;is contactar con la OTC de FGULEM en <a rel=\'noopener\'>otc@fgulem.es</a> o en el tel&eacute;fono <strong>987 29 16 51</strong>.</p>\r\n<h3><strong>Pr&oacute;ximos pasos</strong></h3>\r\n<ol>\r\n<li>Completar los formularios necesarios seg&uacute;n lo indicado.</li>\r\n<li>Preparar los materiales para el registro (instrucciones y dise&ntilde;os).</li>\r\n<li>Si os interesa, valorar la preparaci&oacute;n de una solicitud para la convocatoria ULE-POC.</li>\r\n</ol>\r\n<p>Estamos a vuestra disposici&oacute;n para resolver cualquier duda o apoyar en los siguientes pasos.</p>\r\n<p>Un cordial saludo,<br />[Tu Nombre]<br />[Tu Puesto]<br />[Datos de contacto]</p>','2024-12-13 09:06:05',0),(214,186,NULL,'Contacto investigador','<p>&nbsp;</p>\r\n<p>&nbsp;</p>','2024-12-13 11:53:59',0),(215,26,NULL,'MAIL MJB A IP ENVÍO IET (SIN OBJECIONES)','<div class=\'OutlineElement Ltr SCXO101910403 BCX9\' style=\'margin: 0px; padding: 0px; user-select: text; -webkit-user-drag: none; -webkit-tap-highlight-color: transparent; overflow: visible; cursor: text; clear: both; position: relative; direction: ltr; font-family: \'Segoe UI\', \'Segoe UI Web\', Arial, Verdana, sans-serif; font-size: 12px; background-color: #ffffff;\'>\r\n<p class=\'Paragraph SCXO101910403 BCX9\' lang=\'ES-ES\' style=\'margin: 0px; padding: 0px; user-select: text; -webkit-user-drag: none; -webkit-tap-highlight-color: transparent; overflow-wrap: break-word; vertical-align: baseline; font-kerning: none; background-color: transparent; color: windowtext;\' xml:lang=\'ES-ES\'><span class=\'TextRun SCXO101910403 BCX9\' lang=\'ES-ES\' style=\'margin: 0px; padding: 0px; user-select: text; -webkit-user-drag: none; -webkit-tap-highlight-color: transparent; font-variant-ligatures: none !important; color: windowtext; font-size: 11pt; font-family: Calibri, sans-serif; line-height: 20.7px;\' xml:lang=\'ES-ES\' data-contrast=\'auto\'>Buenos d&iacute;as,</span><span class=\'LineBreakBlob BlobObject DragDrop SCXO101910403 BCX9\' style=\'margin: 0px; padding: 0px; user-select: text; -webkit-user-drag: none; -webkit-tap-highlight-color: transparent; font-size: 11pt; line-height: 20.7px; font-family: WordVisiCarriageReturn_MSFontService, Calibri, sans-serif; color: windowtext;\'><span class=\'SCXO101910403 BCX9\' style=\'margin: 0px; padding: 0px; user-select: text; -webkit-user-drag: none; -webkit-tap-highlight-color: transparent; white-space: pre !important;\'>&nbsp;</span><br class=\'SCXO101910403 BCX9\' style=\'margin: 0px; padding: 0px; user-select: text; -webkit-user-drag: none; -webkit-tap-highlight-color: transparent; white-space: pre !important;\' /></span><span class=\'LineBreakBlob BlobObject DragDrop SCXO101910403 