INSERT INTO `ObjetivoDesarrolloSostenible` VALUES (1,'FIN DE LA POBREZA','Poner fin a la pobreza en todas sus formas en todo el mundo'),(2,'HAMBRE CERO','Poner fin al hambre'),(3,'SALUD Y BIENESTAR','Garantizar una vida sana y promover el bienestar para todos en todas las edades'),(4,'EDUCACION DE CALIDAD','Garantizar una educación inclusiva, equitativa y de calidad y promover oportunidades de aprendizaje durante toda la vida para todos'),(5,'IGUALDAD DE GENERO','Lograr la igualdad entre los géneros y empoderar a todas las mujeres y las niñas'),(6,'AGUA LIMPIA Y SANEAMIENTO','Garantizar la disponibilidad de agua y su gestión sostenible y el saneamiento para todos'),(7,'ENERGÍA ASEQUIBLE Y NO CONTAMINANTE','Garantizar el acceso a una energía asequible, segura, sostenible y moderna'),(8,'TRABAJO DECENTE Y CRECIMIENTO ECONÓMICO','Promover el crecimiento económico inclusivo y sostenible, el empleo y el trabajo decente para todos'),(9,'INDUSTRIAS, INNOVACIÓN E INFRAESTRUCTURAS','Construir infraestructuras resilientes, promover la industrialización sostenible y fomentar la innovación'),(10,'REDUCCIÓN DE LAS DESIGUALDADES','Reducir la desigualdad en y entre los países'),(11,'CIUDADES Y COMUNIDADES SOSTENIBLES','Lograr que las ciudades sean más inclusivas, seguras, resilientes y sostenibles'),(12,'PRODUCCIÓN  Y CONSUMO RESPONSABLES','Garantizar modalidades de consumo y producción sostenibles'),(13,'ACCIÓN POR EL CLIMA','Adoptar medidas urgentes para combatir el cambio climático y sus efectos'),(14,'VIDA SUBMARINA','Conservar y utilizar sosteniblemente los océanos, los mares y los recursos marinos'),(15,'VIDA DE ECOSISTEMAS TERRESTRES','Gestionar sosteniblemente los bosques, luchar contra la desertificación, detener e invertir la degradación de las tierras, detener la pérdida de biodiversidad'),(16,'PAZ, JUSTICIA E INSTITUCIONES SÓLIDARIAS','Promover sociedades justas, pacíficas e inclusivas'),(17,'ALIANZAS PARA LOGRAR LOS OBJETIVOS','Revitalizar la Alianza Mundial para el Desarrollo Sostenible');
/*!40000 ALTER TABLE `ObjetivoDesarrolloSostenible` ENABLE KEYS */;
UNLOCK TABLES;

