INSERT INTO `Plantilla` VALUES (1,'Acuerdo de cotitularidad','47.1','S. Gestión de la Investigación - OTRI','2020.1','<p style=\'text-align: center;\'><strong>ACUERDO ENTRE LA UNIVERSIDAD DE LE&Oacute;N Y ::1.1.1.A.1:: PARA LA COTITULARIDAD DE LA INVENCI&Oacute;N TITULADA ::1.1.1.B.1::</strong><br /><br /><strong>En Le&oacute;n, a ::day:: de ::month:: de ::year::</strong><br /><br /><strong>REUNIDOS</strong></p>\r\n<p style=\'text-align: justify;\'>&nbsp;&nbsp;&nbsp; De una parte,&nbsp; D. CARLOS GASPAR POLANCO DE LA PUENTE, con domicilio a estos efectos en Vicerrectorado de Investigaci&oacute;n y Transferencia, edificio Rectorado, Avda. de la Facultad n&ordm; 25, 24004 - Le&oacute;n, con D.N.I.&nbsp; N&ordm; 09750017H, en representaci&oacute;n de la Universidad de Le&oacute;n (en adelante ULE), con CIF. Q2432001B, actuando como Vicerrector de Investigaci&oacute;n y Transferencia, en virtud de la RESOLUCI&Oacute;N de 8 de febrero de 2021, del Rector de la Universidad de Le&oacute;n, por la que se delegan competencias y atribuciones del Rector en otros &oacute;rganos unipersonales de gobierno.</p>\r\n<p style=\'text-align: justify;\'>[multiple]<br />&nbsp;&nbsp;&nbsp; Y, de otra parte, D./D&ntilde;a ::1.1.1.c.3.x.10::, actuando en representaci&oacute;n ::1.1.1.c.3.x.1:: con CIF ::1.1.1.c.3.x.2:: y domicilio a a efectos de notificaciones derivadas del Acuerdo en ::1.1.1.c.3.x.8::, en calidad de ::1.1.1.c.3.x.4:: de esta entidad, y con poder suficiente para la firma del presente Acuerdo, tal y como se desprende de ::1.1.1.c.3.x.11::</p>\r\n<p style=\'text-align: justify;\'>[/multiple]</p>\r\n<p style=\'text-align: justify;\'>&nbsp;&nbsp;&nbsp; Reconoci&eacute;ndose mutuamente todos los representantes capacidad jur&iacute;dica suficiente, suscriben en nombre de las respectivas entidades el presente acuerdo y, al efecto</p>\r\n<p style=\'text-align: center;\'><strong>MANIFIESTAN</strong></p>\r\n<p style=\'text-align: left;\'>&nbsp;&nbsp;&nbsp; Que como resultado del trabajo realizado por los investigadores de la ULE y por los investigadores de las entidades citadas en el presente documento se han generado resultados susceptibles de explotaci&oacute;n consistentes en \'::1.1.1.b.1::\' y a tal efecto acuerdan suscribir el presente Acuerdo de cotitularidad conforme a las siguientes</p>\r\n<p style=\'text-align: center;\'><strong>CLAUSULAS</strong></p>\r\n<p style=\'text-align: left;\'>&nbsp;&nbsp;&nbsp; <strong>Primera.</strong> - Que el desarrollo del trabajo conjunto entre la ULE y la entidad o entidades citadas en el presente documento, ha dado lugar a la invenci&oacute;n titulada &ldquo;::1.1.1.b.1::&rdquo; bajo la cotitularidad de ambas entidades en la siguiente proporci&oacute;n, dividi&eacute;ndose en id&eacute;ntica proporci&oacute;n los derechos y obligaciones inherentes a la misma: <br />-&nbsp; ::1.1.1.c.3.0.7:: % para la ULE</p>\r\n<p style=\'text-align: left;\'>[multiple]<br />-&nbsp;&nbsp;::1.1.1.c.3.x.7:: % para ::1.1.1.c.3.x.1::</p>\r\n<p style=\'text-align: left;\'>[/multiple]</p>\r\n<p style=\'text-align: left;\'><br />&nbsp;&nbsp;&nbsp;<strong> Segunda. </strong>- Los gastos generales de la tramitaci&oacute;n de la solicitud y mantenimiento de la patente ser&aacute;n soportados por ambas entidades en proporci&oacute;n a su titularidad. <br /><br />&nbsp;&nbsp;&nbsp; La gesti&oacute;n y tramitaci&oacute;n de la protecci&oacute;n ante la Oficina Espa&ntilde;ola de Patentes y Marcas u Oficinas Autorizadas de propiedad industrial de otros pa&iacute;ses, corresponder&aacute; a la ULE, en la persona de su representante, por lo que la entidad o entidades citadas en el presente documento autoriza o autorizan a la ULE a la realizaci&oacute;n de los tr&aacute;mites administrativos correspondientes.</p>\r\n<p style=\'text-align: left;\'><br />&nbsp;&nbsp;&nbsp; <strong>Tercera.</strong> - La extensi&oacute;n de la protecci&oacute;n a otros pa&iacute;ses ser&aacute; acordada por escrito por las partes; de no estar interesada alguna de ellas la otra podr&aacute; continuar en su nombre, adquiriendo todos los derechos y obligaciones sobre los resultados en aquellos pa&iacute;ses que realice por s&iacute; misma la solicitud; en todo caso, ambas partes respetar&aacute;n las condiciones suscritas en este Acuerdo, en relaci&oacute;n con el reparto de beneficios y gastos generales derivados del mismo.<br /><br />&nbsp;&nbsp;&nbsp; Cualquiera de las partes podr&aacute; renunciar en los t&eacute;rminos establecidos en la estipulaci&oacute;n novena a sus derechos sobre la extensi&oacute;n de la protecci&oacute;n a otros pa&iacute;ses.<br /><br />&nbsp;&nbsp;&nbsp; En este caso, la parte interesada en la extensi&oacute;n de la protecci&oacute;n a otros pa&iacute;ses la podr&aacute; llevar a cabo a su cargo y nombre, adquiriendo todos los derechos y obligaciones sobre la invenci&oacute;n en aquellos pa&iacute;ses en que realice por s&iacute; misma la solicitud.<br /><br />&nbsp;&nbsp;&nbsp; Los gastos de mantenimiento de la patente en otros pa&iacute;ses correr&aacute;n a cargo de la entidad solicitante en dichos pa&iacute;ses, manteniendo la proporci&oacute;n indicada en el punto primero, en el caso de una solicitud conjunta.</p>\r\n<p style=\'text-align: left;\'>&nbsp;&nbsp;&nbsp; <strong>Cuarta</strong>. - Ambas entidades se informar&aacute;n mutuamente de las gestiones que se realicen para la explotaci&oacute;n de la invenci&oacute;n, apoy&aacute;ndose en la gesti&oacute;n y proponi&eacute;ndose de mutuo acuerdo las condiciones de licencia a la entidad licenciada. Se firmar&aacute; un contrato con el licenciatario por ambas entidades al efecto.</p>\r\n<p style=\'text-align: left;\'>&nbsp;&nbsp;&nbsp; <strong>Quinta.</strong> -&nbsp; Los beneficios a que diera lugar la explotaci&oacute;n comercial de la invenci&oacute;n se repartir&aacute;n en la proporci&oacute;n a la titularidad de la invenci&oacute;n, una vez deducidos los gastos de comercializaci&oacute;n. La ULE informar&aacute; puntualmente a los contactos facilitados por las entidades cotitulares de la gesti&oacute;n y balances econ&oacute;micos referentes a la invenci&oacute;n.<br /><br />&nbsp;&nbsp;&nbsp; A efectos de cualquier comunicaci&oacute;n relativa al presente contrato, se establecen las siguientes direcciones:<br />Universidad de Le&oacute;n &ndash; Vicerrectorado de Investigaci&oacute;n y Transferencia<br />Avda. de la Facultad de Veterinaria, n&ordm; 25 &ndash; 24004 - Le&oacute;n<br />Tel&eacute;fono: 987 29 1637 <br />Correo: <a href=\'mailto:vice.investigacion@unileon.es\'>vice.investigacion@unileon.es</a></p>\r\n<p style=\'text-align: left;\'>[multiple]<br />Entidad: ::1.1.1.c.3.x.1::<br />Contacto: ::1.1.1.c.3.x.3::<br />Direcci&oacute;n: ::1.1.1.c.3.x.8:: <br />Tel&eacute;fono: ::1.1.1.c.3.x.5::<br />Correo: ::1.1.1.c.3.x.6::</p>\r\n<p style=\'text-align: left;\'>[/multiple]</p>\r\n<p style=\'text-align: left;\'><br />&nbsp;&nbsp;&nbsp; <strong>Sexta.</strong> - El presente contrato surtir&aacute; efectos desde la fecha de su firma y mantendr&aacute; su validez en tanto se encuentren en vigor los t&iacute;tulos de propiedad intelectual e industrial a que puedan dar lugar los resultados de la cl&aacute;usula primera, as&iacute; como los contratos firmados al amparo del presente acuerdo.</p>\r\n<p style=\'text-align: left;\'>&nbsp;&nbsp;&nbsp; <strong>S&eacute;ptima.</strong> - Cualquiera de las partes, podr&aacute; comunicar expresamente a la otra su renuncia de los derechos y obligaciones derivados del presente acuerdo y, por tanto, la otra parte adquirir&aacute; la totalidad de la propiedad de la misma. La parte que adquiere los derechos correr&aacute; con los gastos de cambio de titularidad que procedan.<br /><br />&nbsp;&nbsp;&nbsp; Cualquier renuncia o abandono de los derechos derivados del presente acuerdo se realizar&aacute; por escrito, con suficiente antelaci&oacute;n para que la otra parte pueda ejercer los derechos correspondientes, que en el caso de patentes u otros t&iacute;tulos de propiedad intelectual o industrial ser&aacute; la fecha &uacute;ltima para la toma de decisi&oacute;n que condicionar&aacute; el mantenimiento del derecho.<br /><br />&nbsp;&nbsp;&nbsp; En cualquier caso, la entidad renunciante, se asegurar&aacute; de que todos sus investigadores que consten como inventores en la solicitud de patente, se comprometen a colaborar para la continuaci&oacute;n de la tramitaci&oacute;n de la patente, facilitando la firma de documentos y la notificaci&oacute;n de posibles cambios en su domicilio, manteni&eacute;ndose localizados en todo momento. La entidad renunciante cumplir&aacute; con las obligaciones adquiridas hasta ese momento.</p>\r\n<p style=\'text-align: left;\'>&nbsp;&nbsp;&nbsp; <strong>Octava.</strong> - La ULE y la entidad o entidades citadas en el presente documento, se comprometen a resolver de manera amistosa cualquier desacuerdo que pueda surgir entre las partes.</p>\r\n<p style=\'text-align: left;\'>&nbsp;&nbsp;&nbsp; En caso de conflicto ambas partes acuerdan el sometimiento a la legislaci&oacute;n aplicable y a la jurisdicci&oacute;n competente.</p>\r\n<p style=\'text-align: left;\'>&nbsp;&nbsp;&nbsp; Y en prueba de conformidad, las partes firman el presente Acuerdo por duplicado, en lugar y fecha arriba indicados.</p>\r\n<p style=\'text-align: left;\'>Por la universidad de Leon</p>\r\n<p style=\'text-align: left;\'>&nbsp;</p>\r\n<p style=\'text-align: left;\'>________________________________</p>\r\n<p style=\'text-align: left;\'>EL RECTOR<br />Fdo. D. Carlos G. Polanco de la Puente</p>\r\n<p style=\'text-align: left;\'>[multiple]</p>\r\n<p style=\'text-align: left;\'>Por ::1.1.1.c.3.x.1::</p>\r\n<p style=\'text-align: left;\'>&nbsp;</p>\r\n<p style=\'text-align: left;\'>________________________________</p>\r\n<p style=\'text-align: left;\'>Fdo. ::1.1.1.c.3.x.10::</p>\r\n<p style=\'text-align: left;\'>[/multiple]</p>','2024-08-24 11:44:39'),(2,'Cesión de derechos','47.2','S. Gestión de la Investigación - OT