r en los beneficios, entendidos como diferencia entre ingresos y gastos totales, que obtenga la ULE de la explotaci&oacute;n de la invenci&oacute;n en los porcentajes establecidos en el art&iacute;culo 8.13 del Reglamento de contratos, convenios y proyectos de investigaci&oacute;n de la ULE, y de acuerdo con su porcentaje de participaci&oacute;n en la invenci&oacute;n.</span></p>\r\n<h3 dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>TERCERA</span><span style=\'font-size: 11pt; font-family: Arial,sans-serif; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>: DERECHOS DE LA ULE</span></h3>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>La ULE, o la entidad que &eacute;sta designe, queda facultada para solicitar en nombre del cedente, ante las correspondientes Oficinas y Registros de la Propiedad Industrial, la protecci&oacute;n de los derechos de propiedad industrial, en la forma que estime m&aacute;s conveniente, y a disponer de la misma.</span></p>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt; font-family: \'Trebuchet MS\',sans-serif; color: #000000; background-color: transparent; font-weight: 400; 