\'font-size: 11pt;\'>D. CARLOS GASPAR POLANCO DE LA PUENTE, con domicilio a estos efectos en Vicerrectorado de Investigaci&oacute;n, Edificio Rectorado, Avda. de la Facultad n&ordm; 25, 24004 - Le&oacute;n, con D.N.I.&nbsp; N&ordm; 09750017H, en representaci&oacute;n de la Universidad de Le&oacute;n (en adelante ULE), con CIF. Q2432001B, actuando como Vicerrector de Investigaci&oacute;n, en virtud de la RESOLUCI&Oacute;N de 13 de marzo de 2023, del Rector de la Universidad de Le&oacute;n, por la que se delegan competencias y atribuciones del Rector en otros &oacute;rganos unipersonales de gobierno.</span></p>\r\n<h1 dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt;\'>EXPONEN</span></h1>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt;\'>I </span><span style=\'font-size: 11pt;\'>: Que D./D.&ordf; </span><span style=\'font-size: 11pt;\'>::1.1.1.e.b.x.1:: </span><span style=\'font-size: 11pt;\'>es el/la inventor/a y titular de los derechos de explotaci&oacute;n de la invenci&oacute;n titulada: &ldquo;::1.1.1.b.1::&rdquo; y, en su condici&oacute;n de inventor/a, est&aacute; interesado/a en ceder la titularidad de la mencionada invenci&oacute;n a la ULE, que a su vez est&aacute; interesada en aceptar dicha cesi&oacute;n, lo que llevan a efecto de acuerdo con las siguientes:</span></p>\r\n<h1 dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt;\'>CL&Aacute;USULAS</span></h1>\r\n<h3 dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt;\'>PRIMERA. CESI&Oacute;N EN EXCLUSIVA</span></h3>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt;\'>D./D.&ordf; </span><span style=\'font-size: 11pt;\'>::1.1.1.e.b.x.1:: </span><span style=\'font-size: 11pt;\'>cede en exclusiva la titularidad de la invenci&oacute;n titulada: &ldquo;</span><span style=\'font-size: 11pt;\'>::1.1.1.b.1::</span><span style=\'font-size: 11pt;\'>&rdquo; a la ULE, que acepta la cesi&oacute;n en los t&eacute;rminos previstos en este contrato.&nbsp;</span></p>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt;\'>El cedente cede, en exclusiva para todo el mundo y por el m&aacute;ximo plazo de tiempo que le reconoce la normativa vigente, los derechos de propiedad industrial que le corresponden en virtud de su colaboraci&oacute;n en el proyecto que ha dado origen a la invenci&oacute;n, incluyendo los derechos de titularidad y explotaci&oacute;n de la invenci&oacute;n y dem&aacute;s resultados de la investigaci&oacute;n realizada.</span></p>\r\n<h3 dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt;\'>SEGUNDA. REMUNERACI&Oacute;N</span></h3>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt;\'>La cesi&oacute;n a que se refiere la cl&aacute;usula anterior se realiza a t&iacute;tulo gratuito, por lo que la ULE no deber&aacute; abonar al cedente remuneraci&oacute;n de ninguna especie, sin perjuicio de que el cedente, como inventor, tenga derecho a participar en los beneficios, entendidos como diferencia entre ingresos y gastos totales, que obtenga la ULE de la explotaci&oacute;n de la invenci&oacute;n en los porcentajes establecidos en el art&iacute;culo 8.13 del Reglamento de contratos, convenios y proyectos de investigaci&oacute;n de la ULE, y de acuerdo con su porcentaje de participaci&oacute;n en la invenci&oacute;n.</span></p>\r\n<h3 dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt;\'>TERCERA</span><span style=\'font-size: 11pt; font-family: Arial,sans-serif; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\'>: DERECHOS DE LA ULE</span></h3>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt;\'>La ULE, o la entidad que &eacute;sta designe, queda facultada para solicitar en nombre del cedente, ante las correspondientes Oficinas y Registros de la Propiedad Industrial, la protecci&oacute;n de los derechos de propiedad industrial, en la forma que estime m&aacute;s conveniente, y a disponer de la misma.</span></p>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt;\'>Asimismo, el cedente autoriza a la ULE a ejercer la defensa de los derechos de propiedad industrial objeto de esta cesi&oacute;n si fuera necesario.</span></p>\r\n<p dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt;\'>El cedente se compromete a prestar su colaboraci&oacute;n, en la medida necesaria, para la efectividad de los derechos cedidos, incluyendo la tramitaci&oacute;n de las solicitudes de patentes o de protecci&oacute;n de modelos de utilidad, as&iacute; como de cualquier otro t&iacute;tulo de protecci&oacute;n exclusiva, aunque la relaci&oacute;n con la ULE hubiese finalizado.</span></p>\r\n<h3 dir=\'ltr\' style=\'line-height: 1.7999999999999998; text-align: justify; margin-top: 0pt; margin-bottom: 6pt;\'><span style=\'font-size: 11pt;\'>CUARTA: GARANT&Iacute;A DE LEGITIMIDAD</span></h3>\r\n<p dir=\'ltr\' style=\'l