  `cesionDerechos` tinyint(4) DEFAULT 0,
  `linkCarpeta` varchar(255) DEFAULT NULL,
  `uleAsumeCostes` tinyint(4) DEFAULT 0,
  `agenteReferencia` varchar(255) DEFAULT NULL,
  `urgente` tinyint(4) DEFAULT 0,
  `justificacionUrgencia` varchar(255) DEFAULT NULL,
  `origen` text DEFAULT NULL,
  `revisionInternacionalizacion` text DEFAULT NULL,
