  `matrizRegistro` varchar(255) DEFAULT NULL,
  `acronimo` varchar(255) DEFAULT NULL,
  `docRegistroIPR` varchar(255) DEFAULT NULL,
  `fechaRegistroIPR` varchar(255) DEFAULT NULL,
  `safeEvidenceHash1` varchar(255) DEFAULT NULL,
  `safeEvidenceFecha1` varchar(255) DEFAULT NULL,
  `safeEvidenceMatriz1` varchar(255) DEFAULT NULL,
  `safeEvidenceHash2` varchar(255) DEFAULT NULL,
  `safeEvidenceFecha2` varchar(255) DEFAULT NULL,
  `safeEvidenceMatriz2` varchar(255) DEFAULT NULL,
  `solicitaPOC` varchar(50) DEFAULT NULL,
  `linkCarpetaFGULEM` varchar(255) DEFAULT NULL,
  `gastoActivacion` varchar(255) DEFAULT NULL,
  `referenciaAsignacion` varchar(255) DEFAULT NULL,
  `anotacionEnCeo` varchar(255) DEFAULT NULL,
  `cotitular` varchar(255) DEFAULT NULL,
  `fechaAsignacion` varchar(50) DEFAULT NULL,
  `fechaDivulgacion` varchar(50) DEFAULT NULL,
