dicha investigación.\r\nLos cuatro inventores de la patente aparecen como participantes del proyecto. D. Enrique Alegre, Doña Maite García y Doña Rocío Aláiz, figuran como miembros de dicho proyecto. En el caso de Don Víctor González Castro, a pesar de no ser miembro, participó en varias etapas del proyecto y así se reflejó en las memorias de seguimiento y final presentadas como justificación de las actividades realizadas. Adicionalmente, al residir en UK, se le pagó con cargo a dicho proyecto gastos derivados de su desplazamiento al visitar León para colaborar en las tareas de investigación relacionadas con esta invención, entre otras. ','Hasta determinar si existe interés por alguna empresa en realizar la explotación a nivel internacional, se solicita proteger industrialmente esta invención a nivel nacional. En base al plan de explotación elaborado por la empresa Clark&Modet – ver en sección VI-, se considera que esta invención podría tener también un interés internacional.',NULL,'En el proyecto de investigación financiado por el Ministerio de Economía y Competitividad tres empresas indicaron su interés en los resultados de la investigación y lo concretaron firmando como E.P.O. en la solicitud de dicho proyecto. Estas empresas fueron Tecnoaranda S.L., Manufacturas siderúrgicas del Duero S.L. y Tecoi Corte S.L. De las tres anteriores, la empresa Tecoi Corte S.L., que se dedica a la fabricación de máquina herramienta, en concreto de C.N.C de fresado, participó durante los trabajos realizados en el proyecto proporcionando muestras de plaquitas desgastadas e intactas y poniendo a disposición de los investigadores un cabezal de máquina herramienta que se utilizó para diseñar diversos prototipos utilizados en la adquisición de las imágenes que posteriormente fueron analizadas. También participó en la definición del problema, explicando a los investigadores la problemática existente para monitorizar este desgaste. Además, esta empresa manifestó su interés en disponer de un sistema que permitiera monitorizar el desgaste en estas herramientas y a incluirlo en las máquinas que ella fabrica y vende a empresas de mecanizado. Por otro lado, y por encargo de la FGULEM, la empresa Clarke&Modet ha realizado en los últimos meses un plan de explotación del sistema de monitorización de desgaste de herramienta en fresado. En dicho plan se realiza, entre otras cosas, un análisis de mercado donde se identificó el posicionamiento geoestratégico del estado del arte, las principales características del mercado y un listado preliminar de los potenciales licenciatarios o socios. Sobre los países u oficinas de solicitud de prioridad, se puede ver en la Figura 1 que la región de Asia-Pacífico se presenta en la primera posición en la generación de conocimiento con el 85% de las familias de patentes. En la Tabla 1 puede verse un listado que presenta las principales empresas o entidades de investigación que destacan por publicar el mayor número de patentes relacionadas. La información procede también del plan de explotación realizado por la empresa Clark & Modet. En la Tabla 2, puede verse otro listado de empresas, esta vez ordenado por el número de patentes solicitadas, donde puede verse que la alemana SIEMENS AG es la principal interesada, seguidas de tres universidades asiáticas, y luego de General Electric. Con estos datos queremos de poner en relevancia el interés empresarial por este tipo de tecnologías lo que da una indicación de la posible licencia posterior de esta invención.','2024-11-18 11:43:41',NULL,'','','','','','','','','','','','','','','',NULL,'','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL),(78,89,'2017-03-28 00:00:00',NULL,'P201730426','','ALEGRE GUTIÉRREZ, ENRIQUE','','','SISTEMA Y PROCEDIMIENTO PARA DETERMINAR EL DESGASTE EN PLAQUITAS DE CORTE UTILIZADAS EN OPERACIONES DE FRESADO MEDIANTE CLASIFICACIÓN DE DESCRIPTORES DE FORMA EN IMÁGENES DIGITALES',100,0,0,0,'',0,'CLARKE',1,'','Proyecto de investigación: ','',